/*Table structure for table `posts` */

DROP TABLE IF EXISTS `posts`;

CREATE TABLE `posts` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `active` tinyint(1) DEFAULT 1,
  `title` varchar(255) DEFAULT NULL,
  `description` text DEFAULT NULL,
  `created` datetime DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  `approved` tinyint(1) DEFAULT 0,
  `category_id` int(11) DEFAULT NULL,
  `allow_photo_sharing` tinyint(1) DEFAULT 0,
  `views` int(11) DEFAULT 1,
  `user_id` int(11) DEFAULT NULL,
  `allow_member_comments` tinyint(1) DEFAULT 1,
  `allow_facebook_comments` tinyint(1) DEFAULT 1,
  `likes_user_ids` text DEFAULT NULL,
  `likes_update_time` datetime DEFAULT NULL,
  `block_user_ids` text DEFAULT NULL,
  `block_update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=17446 DEFAULT CHARSET=latin1 COLLATE=latin1_swedish_ci;

/*Data for the table `posts` */

insert  into `posts`(`id`,`active`,`title`,`description`,`created`,`modified`,`approved`,`category_id`,`allow_photo_sharing`,`views`,`user_id`,`allow_member_comments`,`allow_facebook_comments`,`likes_user_ids`,`likes_update_time`,`block_user_ids`,`block_update_time`) values (8,1,'Alumni Reunion','<p>BHEL Higher Secondary School Alumni Reunion on 23rd December 2012 at school premises.</p>','2012-08-14 08:10:48','2020-05-15 01:19:42',0,5,1,4162,NULL,1,1,NULL,NULL,NULL,NULL),(9,1,'About the School','<p>BHEL Higher Secondary School (also known as BHEL HSS) Ramachandrapuram, Hyderabad was established in the year 1965 by the management of BHEL (Bharat Heavy Electricals Limited) for imparting education to the children of their employees.<br /><br />The school commenced its operations from the HRD center of BHEL Ramachandrapuram in the year 1963. The foundation stone for the main branch opposite to BHEL General Hospital, Ramachandrapuram, was laid by Mr. Kailash Behari Mathur Chairman HE (I) L in the year 1964. The first batch of students passed out in the year 1969. The school was run from three separate buildings with sprawling campus of over 20 acres of land. Over 20,000 students passed out from the school between the year 1969 and 2002. The school crossed strength of 3900 students and 160 staff for an academic year.<br /><br />The school provided a very high quality of all round education where diversity was celebrated and valued. BHEL HSS provided education from classes I to XII under the CBSE patten. To ensure complete overall development of children the school encouraged the students to take part in various co-curricular activities like music, dance, arts, sports and NCC.<br /><br />In an exclusive coverage under the heading &ldquo;<strong>SCHOOL WITH WORTHY RECORD</strong>&rdquo; the Indian Express Paper in its Saturday June 28th 1980 edition hailed the results of our school.<br /><br />BHEL HSS Ramachandrapuram Hyderabad was considered to be one of the top 5 schools in the twin cities. The school won many laurels and received many prizes in various cultural, sports and academic competitions held both at state and national levels. To name a few, in the year 1979 the school organized a Science, Arts and Crafts Exhibition which was attended by thousands of people. The same was shown in Bhagyadarshini Programme in TV where Sri M. Gopalakrishna the then IAS secretary Eduction Govt. of Andhra Pradesh, giving valedictory address said that he had not seen such a wonderful Exhibition. The students of the school won all round shield in Atheletics at State Inter School meet conducted by the A.P. Atheletics Association. The All India Radio, Hyderabad broadcasted many programs in which our students participated. The&nbsp; Doordarshan too had telecasted few cultural and sports programs of the children.<br /><br />The school had produced many stalwarts in all professions of life be it defence services, politics, IAS, IPS, Govt. Services, doctors, lawyers, businessman, IT professionals etc. Each one has made niche for themselves in their respective fields.<br /><br />The school became non-operational in the year 2002.</p>','2012-08-14 08:33:36','2024-06-13 16:31:44',0,6,0,15051,NULL,1,1,NULL,NULL,NULL,NULL),(2764,1,'BHEL HSS Alumni Association- Core Committee','<div id=\"id_50ee2ffb575d86083627957\" class=\"text_exposed_root text_exposed\"><span style=\"font-size: medium;\">Executive Committee members </span><br /> <br />\r\n<table style=\"width: 735px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\"><colgroup><col width=\"40\" /> <col width=\"173\" /> <col width=\"49\" /> <col width=\"128\" /> <col width=\"110\" /> <col width=\"235\" /> </colgroup>\r\n<tbody>\r\n<tr>\r\n<td class=\"xl67\" width=\"40\" height=\"22\"><span style=\"font-size: small;\"><strong><span style=\"color: #000000;\">S No</span></strong></span></td>\r\n<td class=\"xl67\" width=\"173\"><span style=\"font-size: small;\"><strong><span style=\"color: #000000;\">Name</spa