 @10am at our School Campus.<br /><br />Agenda of the meeting:</p>\r\n<ul>\r\n<li>Accounting of the expenses incurred regarding the independence day celebrations.</li>\r\n<li>Updating the new people attending the meet.</li>\r\n<li>Involvement of the people in the meet by taking suggestions.</li>\r\n<li>Finalizing about amount to be fixed for the Alumni Celebrations which is to be conducted on December 23rd, 2012.</li>\r\n<li>Asking people to actively participate in adding themselves to the group and also registering themselves to the domain : \"<a title=\"BHEL Higher Secondary School\" href=\"../../../../\">http://bhelhss.com/</a>\" that had come live from this independence day. A remarkable achievement by the ex-students - Preetham Pawar and Arun Shetty.</li>\r\n</ul>\r\n<ul>\r\n<li>Optional :: A game to play as a stress buster.</li>\r\n</ul>\r\n<p><br />With Regards,<br /><strong>Uma Ganesh</strong><br />(PR for the BHEL HSS group)<br />1988 batch - Xth<br />9676803291</p>','2012-08-20 05:28:39','2018-12-08 06:24:44',0,5,0,1357,NULL,1,1,NULL,NULL,NULL,NULL),(14611,1,NULL,NULL,'2013-06-10 03:07:33','2013-06-10 03:07:33',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(805,1,NULL,NULL,'2013-01-09 07:17:57','2013-01-09 07:17:57',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(806,1,NULL,NULL,'2013-01-09 07:54:45','2013-01-09 07:54:45',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(807,1,NULL,NULL,'2013-01-09 08:56:29','2013-01-09 08:56:29',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(808,1,NULL,NULL,'2013-01-09 10:51:00','2013-01-09 10:51:00',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(809,1,NULL,NULL,'2013-01-09 11:18:53','2013-01-09 11:18:53',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(810,1,NULL,NULL,'2013-01-09 11:18:54','2013-01-09 11:18:54',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(811,1,NULL,NULL,'2013-01-09 11:18:55','2013-01-09 11:18:55',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(812,1,NULL,NULL,'2013-01-09 11:18:55','2013-01-09 11:18:55',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(813