ictures.</p>\r\n<p><strong>2. Who can view the photos?</strong></p>\r\n<p style=\"margin-left: 30px;\">Only the members who are registered with bhelhss.com can view the photos. Photos which you upload are public and will be available to all the members of bhelhss.com.</p>\r\n<p><strong>3. What if someone has uploaded a photo whose content is againt the interest of the group?</strong></p>\r\n<p style=\"margin-left: 30px;\">Cast your vote to \'Block\' a photo. If the picture gets more than 1o Block Votes, then it is automatically removed from the site.</p>\r\n<p><strong>4. How do I block a photo?</strong></p>\r\n<p style=\"margin-left: 30px;\">Its, very simple. There\'s a \'Block\' icon provided under every image. Click on the \'Block\' icon to cast your vote. Please make a note this action cannot be reversed.</p>\r\n<p style=\"margin-left: 30px;\">You can also bring this to our notice, by sending the page\'s URL to \'support@bhelhss.com\' .</p>\r\n<p style=\"margin-left: 30px;\">&nbsp;</p>\r\n<p>We encourage all HSSians&nbsp; to take advantage of the image upload features to share those captured moments with all their schoolmates.</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #993300;\"><em>&nbsp;</em></span></p>','2012-09-04 23:02:21','2020-05-15 19:22:57',0,5,0,5371,NULL,1,1,NULL,NULL,NULL,NULL),(15,1,'Old Memories','','2012-09-04 23:33:42','2012-09-04 23:33:42',0,7,1,NULL,NULL,1,1,NULL,NULL,NULL,NULL),(16,1,'Awards And Achievements ','','2012-09-04 23:34:37','2012-09-04 23:34:37',0,7,1,NULL,NULL,1,1,NULL,NULL,NULL,NULL),(714,1,NULL,NULL,'2013-01-07 08:15:25','2013-01-07 08:15:25',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(715,1,NULL,NULL,'2013-01-07 08:15:25','2013-01-07 08:15:25',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(716,1,NULL,NULL,'2013-01-07 08:15:25','2013-01-07 08:15:25',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(717,1,NULL,NULL,'2013-01-07 08:15:25','2013-01-07 08:15:25',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(718,1,NULL,NULL,'2013-01-07 08:15:25','20