endents attending the event<br /><br />Request you to kindly collect your Entry Passes on the day of ALUMINI MEET after furnishing the details of Name, Batch, and Contact Info<br /><br />Donations and Sponsorship&rsquo;s are welcome.<br /><br />Regards,<br /><br />BHEL HIGHER SECONDARY SCHOOL ALUMINI ASSOCIATION</div>','2012-10-28 22:39:49','2020-05-16 11:10:41',0,5,1,2522,NULL,1,1,NULL,NULL,NULL,NULL),(508,1,NULL,NULL,'2013-01-04 08:17:02','2013-01-04 08:17:02',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(509,1,NULL,NULL,'2013-01-04 12:32:42','2013-01-04 12:32:42',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(510,1,NULL,NULL,'2013-01-04 16:22:08','2013-01-04 16:22:08',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(511,1,NULL,NULL,'2013-01-05 03:02:02','2013-01-05 03:02:02',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(512,1,NULL,NULL,'2013-01-05 03:34:57','2013-01-05 03:34:57',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(513,1,NULL,NULL,'2013-01-05 09:32:52','2013-01-05 09:32:52',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(514,1,NULL,NULL,'2013-01-05 09:33:14','2013-01-05 09:33:14',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(515,1,NULL,NULL,'2013-01-05 11:34:47','2013-01-05 11:34:47',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(516,1,NULL,NULL,'2013-01-05 12:31:39','2013-01-05 12:31:39',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(517,1,NULL,NULL,'2013-01-05 17:25:51','2013-01-05 17:25:51',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(604,1,NULL,NULL,'2013-01-07 08:15:03','2013-01-07 08:15:03',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(605,1,NULL,NULL,'2013-01-07 08:15:03','2013-01-07 08:15:03',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(606,1,NULL,NULL,'2013-01-07 08:15:03','2013-01-07 08:15:03',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(607,1,NULL,NULL,'2013-01-07 08:15:03','2013-01-07 08:15:03',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(608,1,NULL,NULL,'2013-01-07 08:15:04','2013-01-07 08:15:04',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(609,1,NULL,NULL,'2013-01-07 08:15:04','2013-01-07 08:15:04',0,N