NULL,NULL),(38,0,'Regarding  INVITATION','<p><span style=\"font-family: arial; font-size: small;\">Dear HSSians,</span></p>\r\n<div>&nbsp;</div>\r\n<div>As you all must be knowing that we are planning a<strong>&nbsp;GRAND ALUMINI MEET</strong>&nbsp;of our Ex-students and Teachers on&nbsp;<strong>23rd December 2012</strong>. &nbsp;We humbly request you all to kindly participate in this event and make it a&nbsp;<strong>GRAND SUCCESS.&nbsp;</strong></div>\r\n<div>&nbsp;</div>\r\n<div>Kindly find the&nbsp;<strong>INVITATION</strong>&nbsp;herewith attached and this pamplet would be circulated in the news papers in the coming up weeks. We are planning a total of 25,000 circulations in BHEL and its surrounding areas.</div>\r\n<div>&nbsp;</div>\r\n<div id=\"yui_3_7_2_1_1350526388572_95\">We have started inviting the teachers by calling them up personally or by sending them an Invitation through &nbsp;email. &nbsp;We have been able to contact 98 teachers/principal so far and 96 of them have confirmed their presence for this meeting so far. We are still in the process of calling up the other Teachers &amp;Non teaching staff.</div>\r\n<div>&nbsp;</div>\r\n<div>We hoisted our National Flag on &nbsp;August 15th 2012 in our School Premises. &nbsp;The Flag hoisting was done by Mr.Sasibhushan (Student of First Batch - 1969). &nbsp; The event was followed by launch of our school website&nbsp;<strong>bhelhss.com</strong>. &nbsp;We request each one of you to kindly register yourselves for the latest updates on the School Alumini Meet. Also look for this space on bhelhss - yahoogroups for latest update</div>\r\n<div>&nbsp;</div>\r\n<div><span style=\"font-family: arial; font-size: small;\">Thanking each one of you in advance and anticipating a&nbsp;favorable&nbsp;response from each one of you in making this event a success</span></div>\r\n<div><strong><br /></strong>\r\n<div><span style=\"font-family: arial;\"><span style=\"font-size: medium;\"><strong>Regards,&nbsp;<br /><br />Uma Ganesh</strong></span></span></div>\r\n<div><span style=\"font-family: arial;\"><span style=\"font-size: medium;\"><strong>1988 - X Batch&nbsp;</strong></span></span></div>\r\n</div>','2012-10-18 07:45:41','2018-08-13 08:16:32',0,5,0,1900,NULL,1,1,NULL,NULL,NULL,NULL),(519,1,NULL,NULL,'2013-01-05 23:25:09','2013-01-05 23:25:09',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(520,1,NULL,NULL,'2013-01-05 23:28:33','2013-01-05 23:28:33',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(521,1,NULL,NULL,'2013-01-05 23:28:34','2013-01-05 23:28:34',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(522,1,NULL,NULL,'2013-01-06 02:23:31','2013-01-06 02:23:31',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(523,1,NULL,NULL,'2013-01-06 02:31:02','2013-01-06 02:31:02',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(524,1,NULL,NULL,'2013-01-06 02:43:21','2013-01-06 02:43:21',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(525,1,NULL,NULL,'2013-01-06 03:16:23','2013-01-06 03:16:23',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(526,1,NULL,NULL,'2013-01-06 05:55:22','2013-01-06 05:55:22',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(527,1,NULL,NULL,'2013-01-06 06:43:35','2013-01-06 06:43:35',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(528,1,NULL,NULL,'2013-01-06 06:43:36','2013-01-06 06:43:36',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(529,1,NULL,NULL,'2013-01-06 06:43:37','2013-01-06 06:43:37',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(530,1,NULL,NULL,'2013-01-06 06:44:03','2013-01-06 06:44:03',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(531,1,NULL,NULL,'2013-01-06 06:44:06','2013-01-06 06:44:06',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(532,1,NULL,NULL,'2013-01-06 06:47:28','2013-01-06 06:47:28',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(533,1,NULL,NULL,'2013-01-06 07:14:34','2013-01-06 07:14:34',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(534,1,NULL,NULL,'2013-01-06 17:40:47','2013-01-06 17:40:47',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(535,1,NULL,NULL,'2013-01-06 21:18:55','2013-01-06 21:18:55',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),