ize: small;\">It\'s been 21 years since I left this school after Xth std and now I will be setting foot in it again, when my daughter is in the Xth std! How time has flown.... but the memories of those glorious school days are still afresh. The news of this Alumni meet has got me so excited. I\'m dying to meet all my friends and teachers. I, &nbsp;occassionally, see some of the teachers and classmates and memories come flooding back. It breaks my heart whenever I go past the school building. How full of life it was, bustling with children, the grounds full of shrieks and laughter of the students, the strict but loving teachers, the amazing labs and libraires, the sports/annual day celebrations. But today it stands forlorn and gloomy! Let\'s bring back life to the school on the 23rd, buddies!</span></p>\r\n<p class=\"current\"><span style=\"font-size: small;\">Amazing, isn\'t it! How we\'ve all been busy in our own lives all these years, but one opportunity of reliving the past has got all of us running down memory lanes. So, Aruna, Sowjanya, S.Lekha, Sanghamitra, Preeti Selvaraj, Preeti Choudhary, Dilawer, Safia, Sreeja, Suma, Anuradha, Mamata, Zeenat, Humera, Meenakshi, Anupama, InduLekha, Krishna, Jitesh, Vikas, Suyaminder, Lawrence, Harikrishna, Saleh... maybe I need to look into the batch photo! Pack your bags, wherever you are ! I don\'t know how many of us are recognizable (I, for one, do not look anywhere near to what I looked back then!) but it would be nice to get surprized by seeing fat, grey-haired aunties and pot-bellied, bald uncles! Left the school on the threshold of youth and coming back again in the middle of mid-age, the youthful giggles replaced with matured smiles, the hesitant first steps out into the world replaced with confident, successful steps . Oh, the days seem so long now. When will 23rd come?</span></p>','2012-12-08 09:50:46','2020-05-18 08:24:08',0,8,0,1519,704,1,0,NULL,NULL,NULL,NULL),(666,1,NULL,NULL,'2013-01-07 08:15:15','2013-01-07