diately as she has to take care of her son who is studying 7th class and another in Inter First year Intermediate. Due to her reserved type , she has not approached anyone other than us.</span><br /><br /><span>Hope you all</span><span class=\"text_exposed_show\">&nbsp;know Mrs.&nbsp;<a href=\"https://www.facebook.com/vasundhara.vasu.100?directed_target_id=0\" data-hovercard=\"/ajax/hovercard/user.php?id=100004226647560&amp;extragetparams=%7B%22directed_target_id%22%3A0%7D\">Vasundhara Vasu</a>,vasundhara_naiyu2000@yahoo.com 1988 batch Xth requires our help, as we all are of one family. She has to have around 40,000/- to undergo surgery. Raising money for surgery is not easy but it\'s well worth the effort of friends / or a big family like us to support her.It\'s a noteworthy cause to which a broad spectrum of people will gladly make contributions. Being innovative and determined is key to raising funds for this type of cause which she is facing single handedly.She has got around 25,000 from our BHEL HSS-ian family. Urgent need of another 15,000 /- needed in two days. Once the money pours in she can undergo her surgery which will be later leading to cancer.&nbsp;</span></p>\r\n<p><span class=\"text_exposed_show\">Hope every one would understand the situation she is in. Helping hands desperately needed.Please&nbsp;come forward to help her, she needs our support to stand on her own legs.&nbsp;</span></p>\r\n<p><span class=\"text_exposed_show\">Thanks to Gururao Sivaram(89), Ravi Dasika(90),Gangula Bhasker Reddy(96),Ravi Bhateji(78), Venket Ramana( 93),Vignesh(92),P.L.Srinivas.</span></p>\r\n<p><span class=\"text_exposed_show\"><span id=\".reactRoot[820].[1][4][1]{comment359234524177544_1686480}.0.[1].0.[1].0.[0].[0][2].0.[13]\">Bank name: ING Vysya Bank</span><br id=\".reactRoot[820].[1][4][1]{comment359234524177544_1686480}.0.[1].0.[1].0.[0].[0][2].0.[14]\" /><span id=\".reactRoot[820].[1][4][1]{comment359234524177544_1686480}.0.[1].0.[1].0.[0].[0][2].0.[15]\">Branch