r /> &ldquo;We all take different paths in life, but no matter where we go, we take a little of each other everywhere&rdquo;</p>\r\n<p><strong>With pride and joy we invite&nbsp;you to join us as we celebrate the GOLDEN JUBLIEE ALUMNI MEET this year on 21st December 2014.&nbsp;</strong></p>\r\n<p>It will be a day to rekindle the child in you. It will also be a day for us to spend our time with our teachers/mentors and good old friends who stood by us. It is a day for us reminisce those wonderful days which you would love to cherish for years more to come. Let us meet to relive our school days and add another page into our memoirs.</p>\r\n<p>It seems like yesterday we were teens, so young and hopeful and full of dreams, it&rsquo;s hard to believe but, years have passed, so let&rsquo;s reconnect to have a blast!&nbsp;</p>\r\n<p>To all the Alumni staying abroad, kindly plan your travel well in advance for GRAND ALUMNI HOME COMING.</p>\r\n<p>We shall keep you posted on further developments.</p>\r\n<p>&nbsp;</p>\r\n<p>Warm Regards</p>\r\n<p>BHEL HSS Alumni Association</p>','2014-09-19 23:33:31','2020-05-15 17:53:39',0,5,1,1602,NULL,1,1,NULL,NULL,NULL,NULL),(15895,1,'GOLDEN JUBILEE ALUMNI CELEBRATIONS 2014','<p>Dear BHEL HSS Alumnus,</p>\r\n<p><br /> &ldquo;We all take different paths in life, but no matter where we go, we take a little of each other everywhere&rdquo;</p>\r\n<p>With pride and joy we invite&nbsp;you to join us as we celebrate the GOLDEN JUBLIEE ALUMNI MEET this year on 21st December 2014.&nbsp;</p>\r\n<p>It will be a day to rekindle the child in you. It will also be a day for us to spend our time with our teachers/mentors and good old friends who stood by us. It is a day for us reminisce those wonderful days which you would love to cherish for years more to come. Let us meet to relive our school days and add another page into our memoirs.</p>\r\n<p>It seems like yesterday we were teens, so young and hopeful and full of dreams, it&rsquo;s hard to believe but, years have passed, so let&rsquo;s reconnect to have a blast!&nbsp;</p>\r\n<p>To all the Alumni staying abroad, kindly plan your travel well in advance for GRAND ALUMNI HOME COMING.<br /> We shall keep you posted on further developments.</p>\r\n<p>&nbsp;</p>\r\n<p>Warm Regards<br /> BHEL HSS Alumni Association</p>','2014-09-19 23:59:48','2020-05-20 12:22:38',0,8,0,1003,64,1,1,NULL,NULL,NULL,NULL),(15896,1,'Social Cause-2014','','2014-09-20 00:04:02','2014-09-20 00:04:02',0,7,1,1,NULL,1,1,NULL,NULL,NULL,NULL),(15897,1,'BHEL HSS Classmate. 1987- Xth Section C','<p><span>Hi Friends</span></p>\r\n<div>&nbsp;</div>\r\n<div>This is Jagadish from BHEL HSS Classmate. It is so nice to see you all in BHEL Alumni.</div>\r\n<div>&nbsp;</div>\r\n<div>Anyone reading this email reach out to me. It is like emailing after 27 years.</div>\r\n<div>&nbsp;</div>\r\n<div>I live in US in Ohio.</div>\r\n<div>&nbsp;</div>\r\n<div>I am on facebook and also on Linked in Connect with me.</div>\r\n<div>&nbsp;</div>\r\n<div>I called Shubhangi Khot in 2006 and she is in Washington DC. But never met her again.</div>\r\n<div>&nbsp;</div>\r\n<div>I remember all of you few times.<br clear=\"all\" />\r\n<div>&nbsp;</div>\r\n<div>Anyone out their?</div>\r\n<div>&nbsp;</div>\r\n<div>With Regards\r\n<div class=\"yj6qo ajU\">\r\n<div id=\":17i\" class=\"ajR\" data-tooltip=\"Hide expanded content\"><img class=\"ajT\" src=\"https://ssl.gstatic.com/ui/v1/icons/mail/images/cleardot.gif\" alt=\"\" /></div>\r\n</div>\r\n<span class=\"HOEnZb adL\"><span style=\"color: #888888;\"><br />Jagadish Prabhala<br />Tel-<a href=\"tel:6147836614\" target=\"_blank\">6147836614</a>(Cell)</span></span></div>\r\n</div>','2014-09-21 09:22:48','2020-05-20 03:39:37',0,8,0,1311,986,1,1,NULL,NULL,NULL,NULL),(15898,1,NULL,NULL,'2014-09-23 08:37:19','2014-09-23 08:37:19',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(15899,1,NULL,NULL,'2014-09-25 11:58:34','2014-09-25 11:58:34',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(15900,1,NULL,NULL