L,NULL,NULL,NULL),(15950,1,'BHELHSS Golden Jubilee Celebrations - Minutes of Meeting, 28th September 2014','<table style=\"width: 710px; height: 1328px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\"><colgroup><col width=\"29\" /> <col width=\"530\" /> </colgroup>\r\n<tbody>\r\n<tr>\r\n<td class=\"xl66\" width=\"29\" height=\"26\">&nbsp;</td>\r\n<td class=\"xl73\" width=\"530\"><span style=\"background-color: #ff9900;\"><strong>Meeting Agenda<span class=\"font6\"> &ndash; BHELHSS Golden Jubilee Celebrations - Meeting 2</span></strong></span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl73\" width=\"530\"><strong>D<span style=\"background-color: #3366ff;\">ate<span class=\"font6\"> - 28-Sept-2014</span></span></strong></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl73\" width=\"530\">Attendees&nbsp;&nbsp; (next sheet)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl74\" width=\"530\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl67\" width=\"530\"><strong>Discussion points</strong></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl67\" width=\"530\"><span style=\"text-decoration: underline;\">&nbsp;</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl71\" width=\"530\"><strong>Event Date - 21 Dec 2014 , 9 am to 5.30 pm (full day event)</strong></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl71\" width=\"530\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"63\">1</td>\r\n<td class=\"xl69\" width=\"530\">An <span class=\"font6\">organizing committee</span><span class=\"font5\"> to consist of around 22&nbsp; \"pillars\" who would in turn reach out to 100 or more students (via their network, social media, whatsapp, etc)</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"21\">2</td>\r\n<td class=\"xl69\" width=\"530\"><span class=\"font6\">Whatsapp group </span><span class=\"font5\">of organizing committee to be formed immediately</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"42\">3</td>\r\n<td class=\"xl69\" width=\"530\">Identify who will be in charge of Digital media designs, etc - owner (event Mgt co, or HSS)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"21\">4</td>\r\n<td class=\"xl69\" width=\"530\">Invites should have 3 different formats (students, teachers, VIPs)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"42\">5</td>\r\n<td class=\"xl69\" width=\"530\"><span class=\"font6\">Connecting to teachers</span><span class=\"font5\"> - principals - Gayatri to revert in case need additional support</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"42\">6</td>\r\n<td class=\"xl69\" width=\"530\">Possibility to develop a&nbsp; mobile APP is being explored&nbsp; to enable connecting of respective batch folks - details to come up soon&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"63\">7</td>\r\n<td class=\"xl69\" width=\"530\"><span class=\"font6\">WEBSITE </span><span class=\"font5\">- to renew and start communication via the same - <br /> it has already been done, events, news being posted, now to become more active</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"42\">8</td>\r\n<td class=\"xl69\" width=\"530\"><span class=\"font6\">Finalization of the agenda </span><span class=\"font5\">for the event - flow of activities in the event - in process&nbsp;</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"42\">9</td>\r\n<td class=\"xl69\" width=\"530\">The events to be planned in such a way that they are participative and enjoyable by all age groups</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"21\">10</td>\r\n<td class=\"xl69\" width=\"530\"><span class=\"font6\">Facebook updation</span><span class=\"font5\"> and active participation from all HSSians</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"42\">11</td>\r\n<td class=\"xl69\" width=\"530\"><span class=\"font6\">Pamplets </span><span class=\"font5\">to be printed - sponsorship invited<br /> Design to be done too</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"21\">12</td>\r\n<td class=\"xl69\" width=\"530\">Posters - sponsorships invited</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"63\">13</td>\r\n<td class=\"xl69\" width=\"530\"><span class=\"font6\">Banners </span><span class=\"font5\">- sponsorship invited<br /> &nbsp;- 1986,1983,1977, 1990 have come forward to contribute - Look forward to active participation for other sponsorships</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"63\">14</td>\r\n<td class=\"xl69\" width=\"530\">Receipt books and 4 wheeler stickers - printing completed - people can collect stickers&nbsp; / receipt books from Sreenivasan / Naveen for volunteering for respective batches</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"21\">15</td>\r\n<td class=\"xl69\" width=\"530\">Sponsorships to be invited from outside as well (approval reqd)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"42\">16</td>\r\n<td class=\"xl71\" width=\"530\">TV Scrolling ads to be explored for TV5, Hibiz, CTV, TV8, any others - pls suggest</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"21\">17</td>\r\n<td class=\"xl69\" width=\"530\">SMS campaigns - being done&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl68\" width=\"530\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl75\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl76\" width=\"530\">Layout logistics</td>\r\n</tr>\r\n<tr>\r\n<td class=