0\"><span class=\"font6\">On Stage - concept</span><span class=\"font5\"> to be different this time, in keeping with theme, TBD</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl72\" align=\"right\" height=\"21\">12</td>\r\n<td class=\"xl68\" width=\"530\">Washrooms - last time inadequate, this time to plan better</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"21\">13</td>\r\n<td class=\"xl68\" width=\"530\">Game zones to be arranged</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl72\" align=\"right\" height=\"42\">14</td>\r\n<td class=\"xl68\" width=\"530\">Check out if the pandal can have some more cooling system - either a different type of roof or coolers</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl72\" align=\"right\" height=\"21\">16</td>\r\n<td class=\"xl68\" width=\"530\">More security to be available</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"21\">17</td>\r\n<td class=\"xl68\" width=\"530\"><span class=\"font6\">Registration counters</span><span class=\"font5\"> to be near main gate</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" align=\"right\" height=\"21\">18</td>\r\n<td class=\"xl69\" width=\"530\"><span class=\"font6\">Office room</span><span class=\"font5\"> in HSS school - permission taken for usage</span></td>\r\n</tr>\r\n</tbody>\r\n</table>','2014-10-27 23:30:00','2020-05-12 20:48:48',0,8,0,1471,64,1,1,NULL,NULL,NULL,NULL),(15951,1,'BHELHSS Golden Jubilee Celebrations - Minutes of Meeting, 19th Oct 2014','<table style=\"width: 830px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\"><colgroup><col width=\"385\" /> <col width=\"445\" /> </colgroup>\r\n<tbody>\r\n<tr>\r\n<td class=\"xl72\" style=\"text-align: center;\" colspan=\"2\" width=\"830\" height=\"22\"><span style=\"color: #ff0000;\">BHELHSS Golden Jubilee Celebrations - Minutes of Meeting</span></td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl64\" width=\"385\" height=\"22\"><span style=\"color: #ff0000;\">Date<span class=\"font5\"> - 28-Sept-2014</span></span></td>\r\n<td class=\"xl65\" width=\"445\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl65\" width=\"445\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl69\" colspan=\"2\" width=\"830\" height=\"88\">a) Seperate Team to reach out&nbsp;for the Life Members in order to avoid confusion to the Volunteers registering Alumni for the Event.&nbsp; The Alumnus&nbsp;are requested to register their names well in advance to plan the event better.&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl69\" colspan=\"2\" width=\"830\" height=\"21\">b) It has been decided to aim for breaking the LIMCA Book of Records.&nbsp; Suma to Co-ordinate for the same</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"21\">EVENT AGENDA&nbsp;</td>\r\n<td class=\"xl65\" width=\"445\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl69\" colspan=\"2\" width=\"830\" height=\"21\">Tentative Schedule of Events (Final list to be published by 15th November 2014)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"21\">Must haves</td>\r\n<td class=\"xl65\" width=\"445\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl65\" width=\"445\">Assembly (To Assemble Batch-wise)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl65\" width=\"445\">Lamp lighting</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl65\" width=\"445\">Address by the Chief Guest</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl66\" width=\"385\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl65\" width=\"445\">Sand Art depicting chronological events&nbsp;of school&nbsp;(To be decided)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl65\" width=\"445\">Slide show capturing&nbsp;some the Memoirs from the past</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl65\" width=\"445\">Games/Teasers by a MC (Involving all the Alumnus) for&nbsp;Fun Programs</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl65\" width=\"445\">Lunch</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"39\">&nbsp;</td>\r\n<td class=\"xl65\" width=\"445\">Events/Programs enacted during our Schoold Days to recollect the glorious days of the past</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"21\">&nbsp;</td>\r\n<td class=\"xl65\" width=\"445\">Hi Tea served with Snacks</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl69\" colspan=\"2\" width=\"830\" height=\"21\">Invite suggestions from schoolmates, via questionaire - Finalize the Program schedule</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl69\" colspan=\"2\" width=\"830\" height=\"21\">Aim should be to bring out the child in the attendees</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"21\">List of activities that need to be taken Care of</td>\r\n<td class=\"xl65\" width=\"445\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"21\">VALET PARKING</td>\r\n<td class=\"xl65\" width=\"445\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"39\">&nbsp;</td>\r\n<td class=\"xl65\" width=\"445\">valet parking to be arranged this time, parking in hospital, around school compound, ZPHS&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"39\">&nbsp;</td>\r\n<td class=\"xl65\" width=\"445\">to arrange for transport / golf cart for people who cant walk from parking to venue</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"21\">REGISTRATIONS</td>\r\n<td class=\"xl65\" width=\"445\">&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl67\" width=\"385\" height=\"39\">&nbsp;</td>\r\n<td class=\"xl65\" width=\"445\">until we know the estimate, challenge for planning the logistics, to plan on inviiting registra