ob - LBR team to provide template for this</td>\r\n<td class=\"xl68\" width=\"210\">LBR team,&nbsp;</td>\r\n<td class=\"xl64\" width=\"69\">In process</td>\r\n<td class=\"xl73\" align=\"right\" width=\"64\">15-Nov</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl63\" align=\"right\" height=\"40\">3</td>\r\n<td class=\"xl64\" width=\"434\">Costing and plan of action for LBR - discuss with LBR team and revert</td>\r\n<td class=\"xl64\" width=\"210\">LBR team</td>\r\n<td class=\"xl64\" width=\"69\">In process</td>\r\n<td class=\"xl73\" align=\"right\" width=\"64\">15-Nov</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl63\" align=\"right\" height=\"100\">4</td>\r\n<td class=\"xl64\" width=\"434\"><span class=\"font5\">Office room in School Premises</span><span class=\"font0\">&nbsp; - Quddoos, Sainathan, Nandakishore and Sreenivasan met the GM HR Mr.Dhananjaya Rao, yet to decide<br /> Further plan for Senior HSS AA President, etc and senior BHEL employees (alumni) to meet the HR as a team and solicit the same</span></td>\r\n<td class=\"xl64\" width=\"210\">Mr. Sasibhushan &amp; other core team members</td>\r\n<td class=\"xl64\" width=\"69\">In process</td>\r\n<td class=\"xl64\" width=\"64\">TBD</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl63\" align=\"right\" height=\"40\">5</td>\r\n<td class=\"xl64\" width=\"434\">Alternate place for registration - a canopy prepared, set up at school&nbsp; for registrations receiving</td>\r\n<td class=\"xl64\" width=\"210\">Sreenivasan</td>\r\n<td class=\"xl64\" width=\"69\">Closed</td>\r\n<td class=\"xl73\" align=\"right\" width=\"64\">9-Nov</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl63\" align=\"right\" height=\"60\">6</td>\r\n<td class=\"xl64\" width=\"434\">we can have area coordinators for registrations&nbsp; - to communicate to the people for registrations - Sreenivasan to send separate communication to them</td>\r\n<td class=\"xl64\" width=\"210\">Sreenivasan</td>\r\n<td class=\"xl64\" width=\"69\">In process</td>\r\n<td class=\"xl73\" align=\"right\" width=\"64\">15-Nov</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl63\" align=\"right\" height=\"160\">7</td>\r\n<td class=\"xl64\" width=\"434\"><span class=\"font5\">Registration </span><span class=\"font0\">may be done by student bringing the following documents - <br /> 1) School Certificate (must have ADMISSION NO.)<br /> 2) Indian Photo id card (must have FATHER&rsquo;S NAME AND DATE OF BIRTH) (Eg. Voter id card/ Adhaar Card / PAN Card / Passport ( 1st and last page) for NRIs)<br /> 3) Photograph for ID Card<br /> </span></td>\r\n<td class=\"xl64\" width=\"210\">Area coordinators to check</td>\r\n<td class=\"xl64\" width=\"69\">In process</td>\r\n<td class=\"xl64\" width=\"64\">tbd</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl63\" align=\"right\" height=\"40\">8</td>\r\n<td class=\"xl64\" width=\"434\"><span class=\"font5\">STALLS - </span><span class=\"font0\">we have received many sponsorship offers - Stall coordinating for receiving the funds - Invite letter in process</span></td>\r\n<td class=\"xl64\" width=\"210\">Stalls team - Sandhya, Sunita, Gorthi Srinivas, Aala Srinivas</td>\r\n<td class=\"xl64\" width=\"69\">In process</td>\r\n<td class=\"xl64\" width=\"64\">tbd</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl63\" align=\"right\" height=\"60\">9</td>\r\n<td class=\"xl65\" width=\"434\">SPONSORSHIPS (of areas of work)<br /> Areas of work required for alumni celebrations - to list out and solicit sponsorships&nbsp;</td>\r\n<td class=\"xl64\" width=\"210\">Vishal, Shahnawaz</td>\r\n<td class=\"xl64\" width=\"69\">In process</td>\r\n<td class=\"xl64\" width=\"64\">tbd</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl63\" align=\"right\" height=\"20\">10</td>\r\n<td class=\"xl64\" width=\"434\">Areas of work - list to be provided&nbsp;</td>\r\n<td class=\"xl64\" width=\"210\">Anil TK and Sreenivasan</td>\r\n<td class=\"xl64\" width=\"69\">In process</td>\r\n<td class=\"xl73\" align=\"right\" width=\"64\">16-Nov</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl63\" align=\"right\" height=\"40\">11</td>