o reopen/rebuild the school.</span></li>\r\n<li><span style=\"font-size: medium;\">The Association would initiate other events like Independence Day, Republic Day celebrations at our school.</span></li>\r\n</ol>','2014-11-14 19:35:43','2020-05-16 02:05:01',0,10,1,1299,NULL,1,1,NULL,NULL,NULL,NULL),(15990,1,'Initiatives','<p><span style=\"text-decoration: underline; font-size: medium;\">BHEL HSS Alumni Association: Initiatives</span></p>\r\n<ol>\r\n<li><span style=\"font-size: medium;\">Alumni Get Together, &ldquo;Euphoria-2012&rdquo;</span></li>\r\n<li><span style=\"font-size: medium;\">Reached out to the ex-students of BHEL HSS through various media.</span></li>\r\n<li><span style=\"font-size: medium;\">Honoring Principles and Teachers</span></li>\r\n<li><span style=\"font-size: medium;\">Extending Help to Teachers</span></li>\r\n<li><span style=\"font-size: medium;\">Extending Help to Alumni</span></li>\r\n<li><span style=\"font-size: medium;\">Independence Day Celebrations at School since 2013</span></li>\r\n<li><span style=\"font-size: medium;\">Republic Day Celebrations at School since 2013</span></li>\r\n<li><span style=\"font-size: medium;\">Candle light march in memory of Jyoti Singh &ndash; known as Nirbhaya, or &lsquo;fearless one&rsquo; and to stand against crimes against women.</span></li>\r\n<li><span style=\"font-size: medium;\">Social Cause- Extend help to an Orphanage.</span></li>\r\n</ol>\r\n<p>&nbsp;</p>','2014-11-14 19:40:47','2020-05-15 16:20:27',0,10,1,1123,NULL,1,1,NULL,NULL,NULL,NULL),(15991,1,'Achievements','<p>BHEL HSS Alumni Association:&nbsp;Achievements</p>\r\n<ol>\r\n<li>The Alumni Get Together was a grand success as nearly 2000 of our Alumni attended the meet and we all could meet Eight Principals and around Seventy Teachers and take their blessings.</li>\r\n<li>A total of 1365 ex-students registered.</li>\r\n<li>Currently we have around 200 Life members and many of them have donated generously.</li>\r\n<li>Established the Alumni and got it registered as per &hellip;.<ol>\r\n<li>Have registered bylaws which have been followed ever since the establishment.</li>\r\n</ol></li>\r\n<li>Opened a Bank account in the name of the Association.</li>\r\n<li>Opened a PAN Card for taxation.</li>\r\n<li>Internal and External Audit conducted.</li>\r\n<li>Core Committee has been formed to:<ol>\r\n<li>To channelize all the efforts of the Alumni.</li>\r\n<li>To get in Authority and Accountability with regard to Decision making and Finances.</li>\r\n<li>Book keeping and Finance &amp; Account Management.</li>\r\n</ol></li>\r\n<li>Formed a group of Volunteers/Coordinators to connect to the Alumni staying at different locations. They would also assist the core committee in decision making.</li>\r\n<li>Created Facebook Account: BHELHSSAA</li>\r\n<li>Created Website: BHELHSS.com</li>\r\n</ol>','2014-11-14 19:50:29','2020-05-15 15:34:56',0,10,1,1273,NULL,1,1,NULL,NULL,NULL,NULL),(15992,1,'Work in Progress','<p><span style=\"font-size: medium;\">BHEL HSS Alumni Association:&nbsp;Work in Progress</span></p>\r\n<ol>\r\n<li><span style=\"font-size: medium;\">Project Planning and work initiations in progress for the Alumni Meet-2014 which is our Golden Jubilee Celebrations of our school.</span></li>\r\n<li><span style=\"font-size: medium;\">Coordinating with BHEL Management to allocate a class room at our school for the Association.</span></li>\r\n<li><span style=\"font-size: medium;\">Limca Book of Records: Team is working in achieving this record. (Highest number of Alumni Get together)&nbsp;</span></li>\r\n</ol>','2014-11-14 19:52:59','2020-05-15 00:34:07',0,10,1,1121,NULL,1,1,NULL,NULL,NULL,NULL),(15993,1,'Core Committee','<p><span style=\"text-decoration: underline; font-size: medium;\">BHEL Higher Secondary School Alumni Association:&nbsp;Core Committee</span></p>\r\n<p>&nbsp;</p>\r\n<table style=\"width: 735px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\"><colgroup><col width=\"40\" /> <col width=\"173\" /> <col wi