tyle=\"color: #000000;\">34</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"157\">\r\n<p><span style=\"color: #000000;\">Swathi Guha</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"49\">\r\n<p align=\"center\"><span style=\"color: #000000;\">1988</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"87\">\r\n<p align=\"center\"><span style=\"color: #000000;\">9618945161</span></p>\r\n</td>\r\n<td valign=\"bottom\" width=\"228\">\r\n<p><span style=\"text-decoration: underline; color: #000000;\">&nbsp;</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"65\">\r\n<p align=\"center\"><span style=\"color: #000000;\">&nbsp;</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td nowrap=\"nowrap\" width=\"40\">\r\n<p align=\"center\"><span style=\"color: #000000;\">35</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"157\">\r\n<p><span style=\"color: #000000;\">Natarajan</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"49\">\r\n<p align=\"center\"><span style=\"color: #000000;\">1988</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"87\">\r\n<p align=\"center\"><span style=\"color: #000000;\">9949037580</span></p>\r\n</td>\r\n<td valign=\"bottom\" width=\"228\">\r\n<p><span style=\"text-decoration: underline; color: #000000;\">&nbsp;</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"65\">\r\n<p align=\"center\"><span style=\"color: #000000;\">&nbsp;</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><strong style=\"color: #000000;\"><span style=\"text-decoration: underline;\">&nbsp;</span></strong></p>\r\n<p><strong style=\"color: #000000;\"><span style=\"text-decoration: underline;\">Event Management &amp; Infrastructure Arrangements Committee</span></strong></p>\r\n<p><span style=\"color: #000000;\">Aim:</span></p>\r\n<ul>\r\n<li><span style=\"color: #000000;\">We have to make arrangements more than 2000 Alumni, 125+ teachers and around 100+ other support staff.</span></li>\r\n<li><span style=\"color: #000000;\">The arrangements should take care of the seating, stage, Food area for Teachers and Alumni, Sound and Visuals, Registration counters and Reception counters, Limca Book of Records initiative, Medical Aid, Parking, Transportation, Cultural, Sports, Convenience and Sponsorship areas.</span></li>\r\n<li><span style=\"color: #000000;\">The Team will decide upon the Cost Estimates by reviewing the quotations from different vendors and finalize the vendor on basis of Capability, Quality and Cost and Value additions.</span></li>\r\n</ul>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Abdul Quddos</span></li>\r\n<li><span style=\"color: #000000;\">DV Suresh</span></li>\r\n<li><span style=\"color: #000000;\">A Sreenivasan</span></li>\r\n<li><span style=\"color: #000000;\">Surya Rao</span></li>\r\n<li><span style=\"color: #000000;\">PC Sreehari</span></li>\r\n<li><span style=\"color: #000000;\">TK Anil</span></li>\r\n<li><span style=\"color: #000000;\">Roopa Rao</span></li>\r\n<li><span style=\"color: #000000;\">Venkat Ramana</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Updates: Considered the required factors and Shortlisted the best vendors for final negotiations and awarding the best vendor who can accomplish our objective.</span></p>\r\n<p><strong style=\"color: #000000;\"><span style=\"text-decoration: underline;\">Food Committee</span></strong></p>\r\n<p>Aim<span style=\"color: #000000;\">:</span></p>\r\n<ul>\r\n<li><span style=\"color: #000000;\">The meet is a daylong event and we have to take care of Food and Refreshments needs of the Alumni.</span></li>\r\n<li><span style=\"color: #000000;\">The Food Committee has to finalize the food arrangements for the meet.</span></li>\r\n<li><span style=\"color: #000000;\">The team needs to decide upon the Food Estimates and Menu</span></li>\r\n<li><span style=\"color: #000000;\">&nbsp;The team will decide upon the Cost Estimates by reviewing the quotations from different vendors and finalize the vendor on basis of Capability, Quality and Cost.</span></li>\r\n</ul>\r\n<p>Members<span style=\"color: #000000;\">:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Arif</span></li>\r\n<li><span style=\"color: #000000;\">Vishal</span></li>\r\n<li><span style=\"color: #000000;\">TK Anil</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Updates: Team received quotations and is in the process to finalize the vendor and the arrangements.</span></p>\r\n<p><span style=\"color: #000000; text-decoration: underline;\">&nbsp;</span></p>\r\n<p><span style=\"color: #000000;\"><strong><span style=\"text-decoration: underline;\">Limca Book of Records</span></strong></span></p>\r\n<p><span style=\"color: #000000;\">Aim: The team would initiate steps to coordinate with the LBR association to mark our initiative to achieve the Limca Book of Records, The record is to achieve a record for </span><strong style=\"color: #000000;\">&ldquo;Most number of Alumni members of a single school to meet at one point/occasion&rdquo; </strong><span style=\"color: #000000;\">The current Indian record stands at around 1400. Our Aim is to cross the 2000 mark.</span></p>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Suma Murthy</span></li>\r\n<li><span style=\"color: #000000;\">T Gopichand</span></li>\r\n<li><span style=\"color: #000000;\">Bijoy Gopi</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Updates: The team has reached out to the LBR association and they will be present and adjudicate the event.</span></p>\r\n<p><span style=\"color: #000000;\">The team has obtained permission from the BHEL administration, who has provided access to our school records which contains student&rsquo;s information like admission numbers and other details, Data entry is in progress.</span></p>\r\n<p><span style=\"color: #000000;\">We require bona fide certificates from the Alumni members to authenticate themselves. We also require ID Proof and a Photograph.</span></p>\r\n<p><span style=\"color: #000000;\">We require 10-15 Gazette officials also to adjudicate the process.</span></p>\r\n<p><strong style=\"color: #000000;\">Request to Alumni Members: Please ensure to attend the event and help us to achieve the record. It will be a proud moment for all of us.</strong></p>\r\n<p><span style=\"color: #000000;\"><strong>Please submit your documents to the Area coordinators in advance.&nbsp; </strong></span></p>\r\n<p><strong style=\"color: #000000;\"><span style=\"text-decoration: underline;\">Cultural Committee</span></strong></p>\r\n<p><span style=\"color: #000000;\">Aim:</span><span style=\"color: #000000;\">To plan and conduct programs so as to engage the Alumni and teachers for the day. The aim is to make the environment nostalgic and apt for the 50 years golden jubilee celebration.</span></p>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Kousalya Bozza</span></li>\r\n<li><span style=\"color: #000000;\">Sampath</span></li>\r\n<li><span style=\"color: #000000;\">Dr. Madhuri</span></li>\r\n<li><span style=\"color: #000000;\">TK Anil</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Updates: The team has come up with cultural items which will be performed during the day. We need more volunteers from the Alumni who can present their shows. Also need 10-15 members who can participate in the march-past.</span></p>\r\n<p><strong style=\"color: #000000;\"><span style=\"text-decoration: underline;\">Transportation</span></strong></p>\r\n<p><span style=\"color: #000000;\">Aim: To Provide Transport for Teachers coming from Secunderabad and Hyderabad. Also need few vehicles to ply members from parking lot to the venue.</span></p>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Ashok Barad</span></li>\r\n<li><span style=\"color: #000000;\">Arif</span></li>\r\n<li><span style=\"color: #000000;\">PC Sreehari</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Updates: Work in progress</span></p>\r\n<p><strong style=\"color: #000000;\"><span style=\"text-decoration: underline;\">Security, Parking and Flag Hoisting</span></strong></p>\r\n<p><span style=\"color: #000000;\">Aim: To plan and execute the Fire and Security requirements at the venue. Also need to plan security at parking lots.</span></p>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Sadiq</span></li>\r\n<li><span style=\"color: #000000;\">Man Mohan</span></li>\r\n<li><span style=\"color: #000000;\">PC Sreehari</span></li>\r\n<li><span style=\"color: #000000;\">TK Anil</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Updates: work in progress</span></p>\r\n<p><strong style=\"color: #000000;\"><span style=\"text-decoration: underline;\">Sponsorship Team</span></strong></p>\r\n<p><span style=\"color: #000000;\">Aim: To reach out to Alumni members and other (corporates and other businesses) to sponsor in areas of Arrangements. A separate area/space would be provided for the Sponsors&rsquo; to display their products or services.</span></p>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Sandhya Rani</span></li>\r\n<li><span style=\"color: #000000;\">Gorthi Srinivas</span></li>\r\n<li><span style=\"color: #000000;\">Uma Ganesh</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Update: Reached out to various members and others, received few sponsorships.</span></p>\r\n<p><strong style=\"color: #000000;\"><span style=\"text-decoration: underline;\">Coordinate with Principals and Teachers</span></strong></p>\r\n<p><span style=\"color: #000000;\">Aim: To reach out to our Principals and Teachers and extend our Invitation.</span></p>\r\n<p><span style=\"color: #000000;\">The teachers will be facilitated during the event.</span></p>\r\n<p><span style=\"color: #000000;\">Also, to understand their conveyance/Transportation needs for them to arrive at the venue.</span></p>\r\n<p><span style=\"color: #000000;\">Member:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Ms. Gayathri (1985)</span></li>\r\n<li><span style=\"color: #000000;\">DV Suresh</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Update: Reached out to more than 150 teachers and more than 100+ teachers have confirmed their presence.&nbsp;</span></p>\r\n<p><strong style=\"color: #000000;\"><span style=\"text-decoration: underline;\">Reception Committee &amp; Volunteer Coordination</span></strong></p>\r\n<p><span style=\"color: #000000;\">Aim: To make arrangements to receive the Teachers at the Venue and arrange for their Refreshments and Convince.</span></p>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Gayathiri</span></li>\r\n<li><span style=\"color: #000000;\">G Narshimha</span></li>\r\n<li><span style=\"color: #000000;\">Natrajan</span></li>\r\n<li><span style=\"color: #000000;\">Bharatha Laxmi Tadiparthy</span></li>\r\n<li><span style=\"color: #000000;\">Sita</span></li>\r\n<li><span style=\"color: #000000;\">P Srinivas Chary</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Update: work in progress</span></p>\r\n<p><strong style=\"color: #000000;\"><span style=\"text-decoration: underline;\">Registration Counters</span></strong></p>\r\n<p><span style=\"color: #000000;\">Aim: To formulate a process to ease and speed up the registrations work flow at the counters.</span></p>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">V Srinivasan</span></li>\r\n<li><span style=\"color: #000000;\">Neelaveni</span></li>\r\n<li><span style=\"color: #000000;\">Swathi Guha</span></li>\r\n<li><span style=\"color: #000000;\">P Sheshagiri</span></li>\r\n<li><span style=\"color: #000000;\">Ravindra Podjale</span></li>\r\n</ol>\r\n<p><strong style=\"color: #000000;\"><span style=\"text-decoration: underline;\">Publicity</span></strong></p>\r\n<p><span style=\"color: #000000;\">Aim: To come out with ideas to reach out to Alumni through print and electronic Media. The team would also work on preparing publicity material, their distribution, placement of banners, posters etc.</span></p>\r\n<p><span style=\"color: #000000;\">Members:&nbsp;</span><span style=\"text-decoration: underline;\">TV and other media coordination : </span><span style=\"color: #000000;\">Sampath, Sashibushan and Stalin N</span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"text-decoration: underline;\">Print: Posters, Banners &nbsp;: </span>Abdul Quddos, Natarajan</span></p>\r\n<p><span style=\"color: #000000;\">Updates: BHEL HSS AA Website, Facebook, Yahoo &amp; Google Groups are being updated regularly; Banners have been placed at different locations. Car Stickers and Flex have been distributed. Posters have been printed and needs to be pasted in different locations. Pamphlets needs to be printed and distributed along with Newspapers.</span></p>\r\n<p><span style=\"color: #000000;\">****************************************************************************************</span></p>\r\n<p><span style=\"color: #000000;\">Note: The Area-Coordinators to update the Core Committee of respective areas with regard to Status updates, Help, Issues and necessary approvals.</span></p>\r\n<p><span style=\"color: #000000;\">Also Note: The committee members are also actively working to provide status update to all via Facebook, Website and other media.</span></p>\r\n<p><span style=\"color: #000000;\">****************************************************************************************</span></p>\r\n<p><span style=\"color: #000000;\"><strong>Request Alumni members to join and help the team as Volunteer and make the event a grand Success. Alumni members to help the committee by referring and reaching out to other Alumni of our school to join the event. Also, Please update your suggestions, views to the committee and also post your Blogs on BHELHSS.COM </strong></span></p>\r\n<p><span style=\"color: #000000;\">&nbsp;</span></p>\r\n<p><span style=\"color: #000000;\">Jai Hind and Jai BHEL HSS</span></p>\r\n<p><span style=\"color: #000000;\">Thanks &amp; Regards</span></p>\r\n<p><span style=\"color: #000000;\">BHEL HSS Alumni Association</span></p>','2014-11-26 11:48:50','2020-05-14 19:10:51',0,10,1,1643,NULL,1,1,NULL,NULL,NULL,NULL),(16036,1,'BHEL HSS Alumni Association Core and Sub-committee Responsibilities and Status Updates','<p style=\"text-align: center;\"><span style=\"color: #000000;\"><strong>Core and Sub-committee Responsibilities and Status Updates</strong></span></p>\r\n<p><span style=\"color: #000000;\"><strong>Registrations</strong></span></p>\r\n<p><span style=\"color: #000000;\"><strong>Aim:</strong>&nbsp;Area Coordinators shall convey the objective of the Alumni Association; the primary objective is to connect to as many Alumni as possible across the globe. The association primarily will be the platform for all the Alumni to connect to each other and also facilitate welfare measures to help Teachers and Students.</span></p>\r\n<p><span style=\"color: #000000;\">With regard to the Event the Area Coordinators shall reach out to as many Alumni as possible and register. Every effort will be made to register maximum number of Alumni well in advance so as to successfully achieve our&nbsp;<strong><em>Limca Book of Records Initiative</em></strong>&nbsp;and to break the Indian record.</span></p>\r\n<p><span style=\"color: #000000;\">Advance registration will also help the committees to plan the arrangements well in advance.</span></p>\r\n<p><span style=\"color: #000000;\">The Area-coordinators need to collect documents (copy of bona fide Certificates and ID Proof) and photographs of the members for LBR initiative.</span></p>\r\n<p><span style=\"color: #000000;\">Updates: The Area-Coordinators have been designated and they have started reaching out to the Alumni. The response is good and Registrations are in progress</span></p>\r\n<p><span style=\"color: #000000;\">Membership Fees:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Life Membership: Rs.1300 (which includes (Rs.300) event fees)</span></li>\r\n<li><span style=\"color: #000000;\">Annual Membership: Rs.500 (which includes (Rs.300) event fees)</span></li>\r\n<li><span style=\"color: #000000;\">Event fee of Rs.300 for existing Life members only. (Those who have paid Rs.1000 or more during 2012)</span></li>\r\n<li><span style=\"color: #000000;\">Donations: As the member&rsquo;s desire.</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\"><strong>Request to all Alumni members</strong>: Please hand over the documents (copy of bona fide Certificates and ID Proof) to the Area coordinators.</span></p>\r\n<p><span style=\"color: #000000;\">Also, please provide photographs of Alumni who are no more, the photographs shall be displayed at the Shardhanjali Area.</span></p>\r\n<p><span style=\"color: #000000;\"><strong>Area Coordinators</strong></span></p>\r\n<table border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td nowrap=\"nowrap\" width=\"40\">\r\n<p align=\"center\"><span style=\"color: #000000;\"><strong>S No</strong></span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"157\">\r\n<p align=\"center\"><span style=\"color: #000000;\"><strong>Name</strong></span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"49\">\r\n<p align=\"center\"><span style=\"color: #000000;\"><strong>Batch</strong></span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"87\">\r\n<p align=\"center\"><span style=\"color: #000000;\"><strong>Mobile</strong></span></p>\r\n</td>\r\n<td width=\"228\">\r\n<p align=\"center\"><span style=\"color: #000000;\"><strong>Mail Id</strong></span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"65\">\r\n<p align=\"center\"><span style=\"color: #000000;\"><strong>