: #000000;\">1988</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"87\">\r\n<p align=\"center\"><span style=\"color: #000000;\">9493692233</span></p>\r\n</td>\r\n<td valign=\"bottom\" width=\"228\">\r\n<p><span style=\"color: #000000;\">&nbsp;</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"65\">\r\n<p align=\"center\"><span style=\"color: #000000;\">&nbsp;</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td nowrap=\"nowrap\" width=\"40\">\r\n<p align=\"center\"><span style=\"color: #000000;\">32</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"157\">\r\n<p><span style=\"color: #000000;\">Naveen Bagade</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"49\">\r\n<p align=\"center\"><span style=\"color: #000000;\">1986</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"87\">\r\n<p align=\"center\"><span style=\"color: #000000;\">9966447121</span></p>\r\n</td>\r\n<td valign=\"bottom\" width=\"228\">\r\n<p><span style=\"color: #000000;\">&nbsp;</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"65\">\r\n<p align=\"center\"><span style=\"color: #000000;\">&nbsp;</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td nowrap=\"nowrap\" width=\"40\">\r\n<p align=\"center\"><span style=\"color: #000000;\">33</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"157\">\r\n<p><span>Bharatha Laxmi Tadiparthy</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"49\">\r\n<p align=\"center\"><span style=\"color: #000000;\">1986</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"87\">\r\n<p align=\"center\"><span style=\"color: #000000;\"><span>99592 25256</span>&nbsp;</span></p>\r\n</td>\r\n<td valign=\"bottom\" width=\"228\">\r\n<p><span style=\"color: #000000;\">&nbsp;</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"65\">\r\n<p align=\"center\"><span style=\"color: #000000;\">&nbsp;</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td nowrap=\"nowrap\" width=\"40\">\r\n<p align=\"center\"><span style=\"color: #000000;\">34</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"157\">\r\n<p><span style=\"color: #000000;\">Swathi Guha</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"49\">\r\n<p align=\"center\"><span style=\"color: #000000;\">1988</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"87\">\r\n<p align=\"center\"><span style=\"color: #000000;\">9618945161</span></p>\r\n</td>\r\n<td valign=\"bottom\" width=\"228\">\r\n<p><span style=\"color: #000000;\">&nbsp;</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"65\">\r\n<p align=\"center\"><span style=\"color: #000000;\">&nbsp;</span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td nowrap=\"nowrap\" width=\"40\">\r\n<p align=\"center\"><span style=\"color: #000000;\">35</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"157\">\r\n<p><span style=\"color: #000000;\">Natarajan</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"49\">\r\n<p align=\"center\"><span style=\"color: #000000;\">1988</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"87\">\r\n<p align=\"center\"><span style=\"color: #000000;\">9949037580</span></p>\r\n</td>\r\n<td valign=\"bottom\" width=\"228\">\r\n<p><span style=\"color: #000000;\">&nbsp;</span></p>\r\n</td>\r\n<td nowrap=\"nowrap\" width=\"65\">\r\n<p align=\"center\"><span style=\"color: #000000;\">&nbsp;</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"color: #000000;\"><strong>&nbsp;</strong></span></p>\r\n<p><span style=\"color: #000000;\"><strong>Event Management &amp; Infrastructure Arrangements Committee</strong></span></p>\r\n<p><span style=\"color: #000000;\">Aim:</span></p>\r\n<ul>\r\n<li><span style=\"color: #000000;\">We have to make arrangements more than 2000 Alumni, 125+ teachers and around 100+ other support staff.</span></li>\r\n<li><span style=\"color: #000000;\">The arrangements should take care of the seating, stage, Food area for Teachers and Alumni, Sound and Visuals, Registration counters and Reception counters, Limca Book of Records initiative, Medical Aid, Parking, Transportation, Cultural, Sports, Convenience and Sponsorship areas.</span></li>\r\n<li><span style=\"color: #000000;\">The Team will decide upon the Cost Estimates by reviewing the quotations from different vendors and finalize the vendor on basis of Capability, Quality and Cost and Value additions.</span></li>\r\n</ul>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Abdul Quddos</span></li>\r\n<li><span style=\"color: #000000;\">DV Suresh</span></li>\r\n<li><span style=\"color: #000000;\">A Sreenivasan</span></li>\r\n<li><span style=\"color: #000000;\">Surya Rao</span></li>\r\n<li><span style=\"color: #000000;\">PC Sreehari</span></li>\r\n<li><span style=\"color: #000000;\">TK Anil</span></li>\r\n<li><span style=\"color: #000000;\">Roopa Rao</span></li>\r\n<li><span style=\"color: #000000;\">Venkat Ramana</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Updates: Considered the required factors and Shortlisted the best vendors for final negotiations and awarding the best vendor who can accomplish our objective.</span></p>\r\n<p><span style=\"color: #000000;\"><strong>Food Committee</strong></span></p>\r\n<p><span style=\"color: #000000;\">Aim:</span></p>\r\n<ul>\r\n<li><span style=\"color: #000000;\">The meet is a daylong event and we have to take care of Food and Refreshments needs of the Alumni.</span></li>\r\n<li><span style=\"color: #000000;\">The Food Committee has to finalize the food arrangements for the meet.</span></li>\r\n<li><span style=\"color: #000000;\">The team needs to decide upon the Food Estimates and Menu</span></li>\r\n<li><span style=\"color: #000000;\">&nbsp;The team will decide upon the Cost Estimates by reviewing the quotations from different vendors and finalize the vendor on basis of Capability, Quality and Cost.</span></li>\r\n</ul>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Arif</span></li>\r\n<li><span style=\"color: #000000;\">Vishal</span></li>\r\n<li><span style=\"color: #000000;\">TK Anil</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Updates: Team received quotations and is in the process to finalize the vendor and the arrangements.</span></p>\r\n<p><span style=\"color: #000000;\">&nbsp;</span></p>\r\n<p><span style=\"color: #000000;\"><strong>Limca Book of Records</strong></span></p>\r\n<p><span style=\"color: #000000;\">Aim: The team would initiate steps to coordinate with the LBR association to mark our initiative to achieve the Limca Book of Records, The record is to achieve a record for&nbsp;<strong>&ldquo;Most number of Alumni members of a single school to meet at one point/occasion&rdquo;&nbsp;</strong>The current Indian record stands at around 1400. Our Aim is to cross the 2000 mark.</span></p>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Suma Murthy</span></li>\r\n<li><span style=\"color: #000000;\">T Gopichand</span></li>\r\n<li><span style=\"color: #000000;\">Bijoy Gopi</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Updates: The team has reached out to the LBR association and they will be present and adjudicate the event.</span></p>\r\n<p><span style=\"color: #000000;\">The team has obtained permission from the BHEL administration, who has provided access to our school records which contains student&rsquo;s information like admission numbers and other details, Data entry is in progress.</span></p>\r\n<p><span style=\"color: #000000;\">We require bona fide certificates from the Alumni members to authenticate themselves. We also require ID Proof and a Photograph.</span></p>\r\n<p><span style=\"color: #000000;\">We require 10-15 Gazette officials also to adjudicate the process.</span></p>\r\n<p><span style=\"color: #000000;\"><strong>Request to Alumni Members: Please ensure to attend the event and help us to achieve the record. It will be a proud moment for all of us.</strong></span></p>\r\n<p><span style=\"color: #000000;\"><strong>Please submit your documents to the Area coordinators in advance.&nbsp;</strong></span></p>\r\n<p><span style=\"color: #000000;\"><strong>Cultural Committee</strong></span></p>\r\n<p><span style=\"color: #000000;\">Aim:To plan and conduct programs so as to engage the Alumni and teachers for the day. The aim is to make the environment nostalgic and apt for the 50 years golden jubilee celebration.</span></p>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Kousalya Bozza</span></li>\r\n<li><span style=\"color: #000000;\">Sampath</span></li>\r\n<li><span style=\"color: #000000;\">Dr. Madhuri</span></li>\r\n<li><span style=\"color: #000000;\">TK Anil</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Updates: The team has come up with cultural items which will be performed during the day. We need more volunteers from the Alumni who can present their shows. Also need 10-15 members who can participate in the march-past.</span></p>\r\n<p><span style=\"color: #000000;\"><strong>Transportation</strong></span></p>\r\n<p><span style=\"color: #000000;\">Aim: To Provide Transport for Teachers coming from Secunderabad and Hyderabad. Also need few vehicles to ply members from parking lot to the venue.</span></p>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Ashok Barad</span></li>\r\n<li><span style=\"color: #000000;\">Arif</span></li>\r\n<li><span style=\"color: #000000;\">PC Sreehari</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Updates: Work in progress</span></p>\r\n<p><span style=\"color: #000000;\"><strong>Security, Parking and Flag Hoisting</strong></span></p>\r\n<p><span style=\"color: #000000;\">Aim: To plan and execute the Fire and Security requirements at the venue. Also need to plan security at parking lots.</span></p>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Sadiq</span></li>\r\n<li><span style=\"color: #000000;\">Man Mohan</span></li>\r\n<li><span style=\"color: #000000;\">PC Sreehari</span></li>\r\n<li><span style=\"color: #000000;\">TK Anil</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Updates: work in progress</span></p>\r\n<p><span style=\"color: #000000;\"><strong>Sponsorship Team</strong></span></p>\r\n<p><span style=\"color: #000000;\">Aim: To reach out to Alumni members and other (corporates and other businesses) to sponsor in areas of Arrangements. A separate area/space would be provided for the Sponsors&rsquo; to display their products or services.</span></p>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Sandhya Rani</span></li>\r\n<li><span style=\"color: #000000;\">Gorthi Srinivas</span></li>\r\n<li><span style=\"color: #000000;\">Uma Ganesh</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Update: Reached out to various members and others, received few sponsorships.</span></p>\r\n<p><span style=\"color: #000000;\"><strong>Coordinate with Principals and Teachers</strong></span></p>\r\n<p><span style=\"color: #000000;\">Aim: To reach out to our Principals and Teachers and extend our Invitation.</span></p>\r\n<p><span style=\"color: #000000;\">The teachers will be facilitated during the event.</span></p>\r\n<p><span style=\"color: #000000;\">Also, to understand their conveyance/Transportation needs for them to arrive at the venue.</span></p>\r\n<p><span style=\"color: #000000;\">Member:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Ms. Gayathri (1985)</span></li>\r\n<li><span style=\"color: #000000;\">DV Suresh</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Update: Reached out to more than 150 teachers and more than 100+ teachers have confirmed their presence.&nbsp;</span></p>\r\n<p><span style=\"color: #000000;\"><strong>Reception Committee &amp; Volunteer Coordination</strong></span></p>\r\n<p><span style=\"color: #000000;\">Aim: To make arrangements to receive the Teachers at the Venue and arrange for their Refreshments and Convince.</span></p>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">Gayathiri</span></li>\r\n<li><span style=\"color: #000000;\">G Narshimha</span></li>\r\n<li><span style=\"color: #000000;\">Natrajan</span></li>\r\n<li><span style=\"color: #000000;\">Bharatha Laxmi Tadiparthy</span></li>\r\n<li><span style=\"color: #000000;\">Sita</span></li>\r\n<li><span style=\"color: #000000;\">P Srinivas Chary</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\">Update: work in progress</span></p>\r\n<p><span style=\"color: #000000;\"><strong>Registration Counters</strong></span></p>\r\n<p><span style=\"color: #000000;\">Aim: To formulate a process to ease and speed up the registrations work flow at the counters.</span></p>\r\n<p><span style=\"color: #000000;\">Members:</span></p>\r\n<ol>\r\n<li><span style=\"color: #000000;\">V Srinivasan</span></li>\r\n<li><span style=\"color: #000000;\">Neelaveni</span></li>\r\n<li><span style=\"color: #000000;\">Swathi Guha</span></li>\r\n<li><span style=\"color: #000000;\">P Sheshagiri</span></li>\r\n<li><span style=\"color: #000000;\">Ravindra Podjale</span></li>\r\n</ol>\r\n<p><span style=\"color: #000000;\"><strong>Publicity</strong></span></p>\r\n<p><span style=\"color: #000000;\">Aim: To come out with ideas to reach out to Alumni through print and electronic Media. The team would also work on preparing publicity material, their distribution, placement of banners, posters etc.</span></p>\r\n<p><span style=\"color: #000000;\">Members: &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;TV and other media coordination :&nbsp;Sampath, Sashibushan and Stalin N</span></p>\r\n<p><span style=\"color: #000000;\">Print: Posters, Banners &nbsp;:&nbsp;Abdul Quddos, Natarajan</span></p>\r\n<p><span style=\"color: #000000;\">Updates: BHEL HSS AA Website, Facebook, Yahoo &amp; Google Groups are being updated regularly; Banners have been placed at different locations. Car Stickers and Flex have been distributed. Posters have been printed and needs to be pasted in different locations. Pamphlets needs to be printed and distributed along with Newspapers.</span></p>\r\n<p><span style=\"color: #000000;\">****************************************************************************************</span></p>\r\n<p><span style=\"color: #000000;\">Note: The Area-Coordinators to update the Core Committee of respective areas with regard to Status updates, Help, Issues and necessary approvals.</span></p>\r\n<p><span style=\"color: #000000;\">Also Note: The committee members are also actively working to provide status update to all via Facebook, Website and other media.</span></p>\r\n<p><span style=\"color: #000000;\">****************************************************************************************</span></p>\r\n<p><span style=\"color: #000000;\"><strong>Request Alumni members to join and help the team as Volunteer and make the event a grand Success. Alumni members to help the committee by referring and reaching out to other Alumni of our school to join the event. Also, Please update your suggestions, views to the committee and also post your Blogs on BHELHSS.COM</strong></span></p>\r\n<p><span style=\"color: #000000;\">&nbsp;</span></p>\r\n<p><span style=\"color: #000000;\">Jai Hind and Jai BHEL HSS</span></p>\r\n<p><span style=\"color: #000000;\">Thanks &amp; Regards</span></p>\r\n<p><span style=\"color: #000000;\">BHEL HSS Alumni Association</span></p>','2014-11-26 11:51:24','2020-05-16 10:23:47',0,5,1,1468,NULL,1,1,NULL,NULL,NULL,NULL),(16037,1,NULL,NULL,'2014-11-26 16:37:20','2014-11-26 16:37:20',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16038,1,NULL,NULL,'2014-11-26 20:11:14','2014-11-26 20:11:14',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16039,1,NULL,NULL,'2014-11-26 23:24:43','2014-11-26 23:24:43',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16040,1,NULL,NULL,'2014-11-27 02:40:14','2014-11-27 02:40:14',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16041,1,NULL,NULL,'2014-11-27 14:32:21','2014-11-27 14:32:21',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16042,1,NULL,NULL,'2014-11-27 14:46:09','2014-11-27 14:46:09',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16043,1,'Refer your school friend','<p>Do you have a friend who is not registered with bhelhss.com and want them to be a part of upcoming events? Send us the Email address or Phone no. of the person by filling the form \'<a title=\"Refer your school friend\" href=\"../../../ReferFriends/referafriend\" target=\"_blank\">Refer your school friend</a>\' online. We will contact the person and try to make sure they are registered with bhelhss.com.</p>\r\n<div><span>************************************************************************************************************</span></div>\r\n<div id=\"yui_3_16_0_1_1417112611281_9147\"><span id=\"yui_3_16_0_1_1417112611281_9146\">Dear HSSians, </span></div>\r\n<div>&nbsp;</div>\r\n<div id=\"yiv9063708971id_54527c0f20c173d50584914\">\r\n<div id=\"yui_3_16_0_1_1417112611281_8862\">It is with a great pride and joy we invite you to join us, as we celebrate the GOLDEN JUBLIEE-ALUMNI MEET this year on <strong>21st December 2014</strong>. We are collecting a nominal fee towards the Alumni Meet Celebrations, the details of which are mentioned below.</div>\r\n<div><span id=\"yui_3_16_0_1_1417112611281_8827\" style=\"color: #ffffff;\"><span id=\"yui_3_16_0_1_1417112611281_8826\">Request you to kindly collect your&nbsp;passes in advance to help us plan the event better and avoid last minute&nbsp;rus</span>h</span><span style=\"color: #ffffff;\">.</span></div>\r\n<div id=\"yui_3_16_0_1_1417112611281_8883\">\r\n<div id=\"yui_3_16_0_1_1417112611281_8882\">Membership and Meet Fee:<br clear=\"none\" /><ol>\r\n<li><span>Life Membership: Rs.1300 (which includes (Rs.300) event fees)</span></li>\r\n<li><span>Annual Membership: Rs.500 (which includes (Rs.300) event fees)</span></li>\r\n<li><span>Event fee of Rs.300 for existing Life members only. (Those who have paid Rs.1000 or more during 2012)</span></li>\r\n<li><span>Donations: As the member&rsquo;s desire.</span></li>\r\n</ol></div>\r\n<div><span style=\"text-decoration: underline;\">FUND TRANSFERS</span>:</div>\r\n<div id=\"yui_3_16_0_1_1417112611281_9150\">We have an Account in Vijaya Bank in the name of our Association &ldquo;<strong>BHEL HIGHER SECONDARY SCHOOL ALUMINI ASSOCIATION</strong>&rdquo;. The bank details are mentioned below:</div>\r\n<div id=\"yui_3_16_0_1_1417112611281_9151\"><strong>Bank: Vijaya Bank</strong><br clear=\"none\" /><strong>Branch: Chandanagar</strong><br clear=\"none\" /><strong>Account No: 403101011006886</strong><br clear=\"none\" /><strong>IFSC Code: VIJB0004031</strong></div>\r\n<div>&nbsp;</div>\r\n<div id=\"yui_3_16_0_1_1417112611281_9152\">Request you to kindly furnish the screen shot of Transaction ID to the Mail ID: bhelhssaa@gmail.com with following details:</div>\r\n<div id=\"yui_3_16_0_1_1417112611281_9153\">Member&rsquo;s Name</div>\r\n<div>Batch<br clear=\"none\" />Contact Info (Email ID and Mobile No)<br clear=\"none\" />No. of dependents attending the event</div>\r\n<div>&nbsp;</div>\r\n<div>The scanned copy of your receipt will be sent to your mail id.&nbsp; .</div>\r\n<div>&nbsp;</div>\r\n<div><span><span style=\"text-decoration: underline;\">Alumni Residing in Hyderabad</span></span></div>\r\n<div>&nbsp;</div>\r\n<div>Kindly collect your passes from our school on Sunday\'s between 11:00 am to 1:00 pm and&nbsp; 4:00 pm to 6:00 pm</div>\r\n<div>&nbsp;</div>\r\n<div>Regards,</div>\r\n<div id=\"yui_3_16_0_1_1417112611281_9172\">BHEL HIGHER SECONDARY SCHOOL ALUMINI ASSOCIATION<br clear=\"none\" />Call Mobile: 9493692233 / 9849353793 for any further updates</div>\r\n<div>Email to: <a href=\"mailto:bhelhssaa@gmail.com\">bhelhssaa@gmail.com</a>&nbsp;</div>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>\r\n<p>If you have any suggestions/improvements, let us know <a title=\"Contact us\" href=\"../../../contactus\" target=\"_blank\">here</a> or contact us at <a title=\"support@bhelhss.com\" href=\"mailto:support@bhelhss.com\" target=\"_blank\">support@bhelhss.com</a>.</p>','2014-11-27 15:54:20','2020-05-18 21:28:12',0,5,0,1580,NULL,1,1,NULL,NULL,NULL,NULL),(16044,1,'Golden Jubilee Alumni Event on 21st December 2014 ','<p><span>Dear Folks,</span></p>\r\n<p><span>We met more than 100 Teachers last time in 2012, This year more than 120 Teachers have confirmed their presence for the event, let&rsquo;s all make it to the event and have their blessings.</span></p>\r\n<p><span>It was a great feeling meeting our classmates, Seniors and Friends, lets meet again and make this year too a memorable one.</span></p>\r\n<p><span>Also, we want to break the Indian Record for the \"Largest Alumni Event\", the current record stands at around 1400 we can easily break it as last time in 2012 we were 2000+. Therefore, please register immediately for the Limca Book of Records Initiative.</span></p>\r\n<p><span>&nbsp;</span></p>\r\n<p><span>Regards</span></p>\r\n<p><span>BHEL HSS Alumni Association</span>&nbsp;</p>\r\n<p>&nbsp;</p>','2014-11-28 09:49:19','2020-05-13 11:53:08',0,8,0,1246,64,1,1,NULL,NULL,NULL,NULL),(16045,1,NULL,NULL,'2014-11-29 08:27:23','2014-11-29 08:27:23',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16046,1,NULL,NULL,'2014-11-29 12:39:14','2014-11-29 12:39:14',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16047,1,NULL,NULL,'2014-11-29 13:52:29','2014-11-29 13:52:29',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16048,1,NULL,NULL,'2014-11-29 14:41:08','2014-11-29 14:41:08',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16049,1,NULL,NULL,'2014-11-29 19:13:15','2014-11-29 19:13:15',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16050,1,NULL,NULL,'2014-11-29 19:15:04','2014-11-29 19:15:04',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16051,1,NULL,NULL,'2014-11-30 02:37:25','2014-11-30 02:37:25',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16052,1,NULL,NULL,'2014-11-30 10:16:16','2014-11-30 10:16:16',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16053,1,NULL,NULL,'2014-11-30 11:31:36','2014-11-30 11:31:36',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16054,1,NULL,NULL,'2014-11-30 12:06:46','2014-11-30 12:06:46',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16055,1,NULL,NULL,'2014-11-30 17:28:58','2014-11-30 17:28:58',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16056,1,NULL,NULL,'2014-11-30 18:45:18','2014-11-30 18:45:18',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16057,1,NULL,NULL,'2014-11-30 19:06:31','2014-11-30 19:06:31',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16058,1,NULL,NULL,'2014-12-01 14:03:51','2014-12-01 14:03:51',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16059,1,NULL,NULL,'2014-12-01 15:12:44','2014-12-01 15:12:44',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16060,1,'GOLDEN JUBILEE ALUMNI CELEBRATIONS-2014-INVITATION TO ALL BHEL HSS ALUMNI','<p><strong>Dear BHEL HSS Alumnus,</strong></p>\r\n<p>&ldquo;We all take different paths in life, but no matter where we go, we take a little of each other everywhere&rdquo;</p>\r\n<p><strong>With pride and joy we invite&nbsp;you to join us as we celebrate the GOLDEN JUBLIEE ALUMNI MEET this year on 21st December 2014. This year we are attempting to break the Indian Record of the Largest getogether of Alumni members.</strong></p>\r\n<p>It will be a day to rekindle the child in you. It will also be a day for us to spend our time with our teachers/mentors and good old friends who stood by us. It is a day for us reminisce those wonderful days which you would love to cherish for years more to come. Let us meet to relive our school days and add another page into our memoirs.</p>\r\n<p>It seems like yesterday we were teens, so young and hopeful and full of dreams, it&rsquo;s hard to believe but, years have passed, so let&rsquo;s reconnect to have a blast!&nbsp;</p>\r\n<p>To all the Alumni staying abroad, kindly plan your travel well in advance for GRAND ALUMNI HOME COMING.</p>\r\n<p><span>This time we have more than 120 Teachers including Principals attending our meet. The other big attraction&nbsp;is our Limca Book of Records Initiative. We are going to break the Indian Record and we expect you all to be a part of that record.</span></p>\r\n<p>Warm Regards</p>\r\n<p>BHEL HSS Alumni Association</p>','2014-12-01 17:04:46','2020-05-16 00:31:22',0,5,1,1926,NULL,1,1,NULL,NULL,NULL,NULL),(16061,1,NULL,NULL,'2014-12-01 18:13:41','2014-12-01 18:13:41',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16063,1,'LBR- Lets break the Record','<p>Dear Alumni,</p>\r\n<p>The big event within our Get-together is our LBR Initiative. We are going to break the Indian Record and&nbsp;<strong>we expect you all to be a part of that record.</strong></p>\r\n<p>Last year 2000+ of our Alumni attended and this year too we need to come in large numbers and break the record.&nbsp;</p>\r\n<p>The LBR officer would visit the school on 21st December and validate the event.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>So please be there and make a mark for us and the school.</strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong>Regards</strong></p>\r\n<p><strong>BHEL HSS Alumni Association.</strong></p>','2014-12-01 19:52:38','2020-05-16 00:31:42',0,5,1,1132,NULL,1,1,NULL,NULL,NULL,NULL),(16143,1,NULL,NULL,'2014-12-02 03:39:43','2014-12-02 03:39:43',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16064,1,NULL,NULL,'2014-12-01 20:38:01','2014-12-01 20:38:01',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16065,1,NULL,NULL,'2014-12-01 20:39:53','2014-12-01 20:39:53',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16066,1,NULL,NULL,'2014-12-01 20:39:55','2014-12-01 20:39:55',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16067,1,NULL,NULL,'2014-12-01 20:39:56','2014-12-01 20:39:56',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16068,1,NULL,NULL,'2014-12-01 20:39:58','2014-12-01 20:39:58',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16069,1,NULL,NULL,'2014-12-01 20:39