 class=\"xl68\" style=\"text-align: center;\" width=\"710\">Activity</td>\r\n<td class=\"xl68\" width=\"265\">Responsibility</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl65\" align=\"right\" height=\"44\">1</td>\r\n<td class=\"xl66\" width=\"710\">LBR Team Updates: Data Entry of Admission records completed. Validation process is in Progress.</td>\r\n<td class=\"xl66\" width=\"265\">Suma Murthy, Gopichand &amp; Bijoy Gopi</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl65\" align=\"right\" height=\"44\">2</td>\r\n<td class=\"xl66\" width=\"710\">LBR Team to plan and discuss the Work Flow Process of the LBR Initiative for the Event Day. (A Dry run was initiated, need a clear execution plan)</td>\r\n<td class=\"xl66\" width=\"265\">Suma Murthy, Gopichand &amp; Bijoy Gopi</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl65\" align=\"right\" height=\"44\">3</td>\r\n<td class=\"xl66\" width=\"710\">LBR Team to submit cost Estimates of all items to finalize the budgetary approvals.</td>\r\n<td class=\"xl66\" width=\"265\">Suma Murthy, Gopichand &amp; Bijoy Gopi</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl65\" align=\"right\" height=\"22\">4</td>\r\n<td class=\"xl66\" width=\"710\">Area Coordinators to collect Documents from Registered members and submit them to LBR Team</td>\r\n<td class=\"xl66\" width=\"265\">Area Coordinators</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl65\" align=\"right\" height=\"44\">5</td>\r\n<td class=\"xl66\" width=\"710\">Core Team to coordinate with Area-Coordinators and other Volunteers to consolidate Registrations/Participation estimates.</td>\r\n<td class=\"xl66\" width=\"265\">V Srinivasan (Treasurer)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl65\" align=\"right\" height=\"88\">6</td>\r\n<td class=\"xl66\" width=\"710\">Event Management Committee to continue discussion with the Finalized Event Manager and come up with execution plan. Also, Identify, Plan and budget other areas of the Events as well.&nbsp;</td>\r\n<td class=\"xl66\" width=\"265\">Event Management Committee. (DV Suresh, PC Sreehari, Surya Rao, Venkat Ramana, TK Anil, Roopa and A Sreenivasan)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl65\" align=\"right\" height=\"44\">7</td>\r\n<td class=\"xl66\" width=\"710\">Cultural Committee needs to list out the probable program items and come out with Execution plan and budget estimates if any.</td>\r\n<td class=\"xl66\" width=\"265\">Cultural Committee. (Kousalya, Sampath, TK Anil)</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl65\" align=\"right\" height=\"44\">8</td>\r\n<td class=\"xl66\" width=\"710\">Food Committee to finalize on the Vendor and provide budget estimates and execution plan.</td>\r\n<td class=\"xl66\" width=\"265\">Food Committee: Arif, Vishal, TK Anil</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl65\" align=\"right\" height=\"22\">9</td>\r\n<td class=\"xl66\" width=\"710\">Transport committee to come up with Plans: Arif, PC, please coordinate with Ashok Barad.</td>\r\n<td class=\"xl66\" width=\"265\">Arif, PC Sreehari, Ashok Barad</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl65\" align=\"right\" height=\"44\">10</td>\r\n<td class=\"xl66\" width=\"710\">Security &amp; Safety: TK will coordinate with Manmohan, PC and Sadiq and come out with execution plan and budgets</td>\r\n<td class=\"xl66\" width=\"265\">Sqdiq, Manmohan, PC, TK</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl65\" align=\"right\" height=\"22\">11</td>\r\n<td class=\"xl66\" width=\"710\">Sponsorship Committee: Team to provide the final list of sponsors and come with execution plan</td>\r\n<td class=\"xl66\" width=\"265\">Gorthi Srinivas, Sandhya Rani</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl63\" align=\"right\" height=\"22\">12</td>\r\n<td class=\"xl66\" width=\"710\">Need around 50 Volunteers, All to reach out and check out for volunteers</td>\r\n<td class=\"xl66\" width=\"265\">All Alumni members</td>\r\n</tr>\r\n<tr>\r\n<td class=\"xl65\" align=\"right\" height=\"66\">13</td>\r\n<td class=\"xl66\" width=\"710\">As a Pre-event initiative and also a social Initiative we have decided to conduct a Swaachh Bharath-Clean our School campaign on Sunday the 7th December. All Alumni members to attend. Also planned to have a cricket match as well</td>\r\n<td class=\"xl66\" width=\"265\">TK Anil, Gopichand</td>\r\n</tr>\r\n</tbody>\r\n</table>','2014-12-02 13:17:54','2020-05-16 19:14:26',0,5,1,1451,NULL,1,1,NULL,NULL,NULL,NULL),(16145,1,'SWACHH BHARAT- Clean Our School Campaign','<p>Dear Alumni,</p>\r\n<p>We have initiated a <strong><em>Swachh Bharat - Clean our School Campaign </em></strong>on 7<sup>th</sup> December 2014 at 11 AM. All Alumni members are requested to attend the campaign and make the initiative a grand success.</p>\r\n<p>We are all responsible individuals and let&rsquo;s join hands to spread the cleanliness drive.</p>\r\n<p><strong><em>Folks: Remember, what we were told to do when were late to our school? &nbsp;We had Swachh School in those days as well!!!!!! </em></strong><strong><em>J</em></strong></p>\r\n<p>The Event will be followed by Planning meet and a Cricket Match&hellip;&hellip; so let&rsquo;s have some fun.</p>\r\n<p>Regards</p>\r\n<p>BHEL HSS Alumni Association</p>','2014-12-02 13:46:25','2020-05-15 11:25:03',0,5,1,1342,NULL,1,1,NULL,NULL,NULL,NULL),(16146,1,NULL,NULL,'2014-12-02 23:36:43','2014-12-02 23:36:43',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16147,1,NULL,NULL,'2014-12-03 02:46:42','2014-12-03 02:46:42',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16148,1,NULL,NULL,'2014-12-03 06:55:09','2014-12-03 06:55:09',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16149,1,NULL,NULL,'2014-12-03 08:47:30','2014-12-03 08:47:30',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16150,1,NULL,NULL,'2014-12-03 12:20:33','2014-12-03 12:20:33',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16151,1,NULL,NULL,'2014-12-03 17:46:32','2014-12-03 17:46:32',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16152,1,NULL,NULL,'2014-12-04 10:15:01','2014-12-04 10:15:01',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16153,1,NULL,NULL,'2014-12-04 14:13:28','2014-12-04 14:13:28',0,N