,NULL,NULL,NULL,NULL),(16250,1,NULL,NULL,'2014-12-14 18:38:58','2014-12-14 18:38:58',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16251,1,NULL,NULL,'2014-12-14 23:48:49','2014-12-14 23:48:49',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16252,1,'Our own Class mate Viswa Vemuri performing on stage with us.','<p>Hi BHEL Higher Secondary School friends, wish to have a cultural program! Our great all rounder in film music Mr. Viswa giving a lively musical evening show in our Golden Jubilee event. Shall we go for it.................... Common folks</p>\r\n<p>The&nbsp;<a class=\"profileLink\" href=\"https://www.facebook.com/viswa.vemuri\" data-hovercard=\"/ajax/hovercard/user.php?id=100001536003002\">Viswa Vemuri</a>\'s Biography:-</p>\r\n<p>Viswa the multi-faceted artiste is a blend of lyrical, vocal and musical skills with an added flavour of his creative abilities. He is usually called &ldquo;Master of all trades&rdquo;. He is not a regular &ldquo;run-of-the-mill&rdquo; artiste but surely is an entertaining one.</p>\r\n<p>The tale started when he was 6 yrs old. One day he was singing in a Durga pandal he was heard by thespian maestro Nemalikanti Radha Krishna Murthy and was picked for a play called &ldquo;Mugimpu leni Katha- written by Rallapalli (a veteran actor/author). Viswa won his first award at the age of 6, from Andhra Naataka Parishad (which was one of the most prestigious awards by the AP state Govt.before Nandi Award was introduced) as &ldquo;The Best Child Actor&rdquo;. As he grew up he emerged as a theatre artist and performed many plays at different places till the age of 14. Theatre has created immense interest and love in him for literature and music. Music and Literature took front seat in his career interests and priorities.</p>\r\n<p>Viswa had his academic stint at Andhra University where he studied Mechanical engineering degree. Soon after the completion of his degree he set out on a journey to explore his musical skills. Through a friend and musician Siva Ram he met Mani Sharma. Mani Sharma gave Viswa tremendous encouragement and a pathway into Telugu films. He was the first one to identify Viswa&rsquo;s innate lyrical, singing and musical abilities. He offered Viswa the first opportunity in one of his films named &ldquo;Priyadarshini to write as well as sing a solo song. Later, Viswa released his first music album &ldquo;Masti&rdquo; which was written, sung and composed by Viswa.</p>\r\n<p><br />R P Patnaik then offered a song in his film &ldquo;Santosham&rdquo; which was a Nagarjuna, Prabhu Deva starrer. Viswa wrote and sang a dance number &ldquo;Mehbooba Mehabooba&rdquo; which has earned him his first recognition and hit. Offers started coming in and Viswa got recognised as a lyricist who can write catchy expressions and euphemisms. He wrote for films like Adrushtam, Sivamani, Satyam and many more after that.</p>\r\n<p>A few movies later, Veteran writer and director Trivikram Srinivas who is a good friend and also studied with him in the same University offered him the title song in his upcoming film Athadu, which was written and sung by Viswa. The song went on to become an overwhelming hit and not only that it also became the biggest milestone in Viswa&rsquo;s career. The song&rsquo;s success was followed by the opportunities for title songs for films like Munna, Aarya, Asthram, Dookudu, Nippu, Teen Maar, and became huge hits. Chamka Chamka became a big hit for Ram Charan Tej. Viswa&rsquo;s songs became distinctive in every album. His style of writing and singing is unique in its own way.</p>\r\n<p>Dhaga Dhaga merise from the movie Lakshmi, You rock my world from Arya, Narthanatara from Ek Niranjan, Dole Dole from Pokiri, Disturb Cheyyaku fro athidhi, Gicchi Gicchi and Chandra Mukhi from Super, Ye oore from Badra, Va Va Varevaa from Bunny, Chal Chal re from Happy, Gundelni Pindedhi from Devdas, Yadalo Evo and Rock and Roll from Style are some of his prestigious hits which catapulted him into the league of star writers and singers. Dole Dole from Pokiri got acclaimed for its aesthetic appeal and captivating lyrics. Even in fims like Takita Takita, Mangala, Manasu Maata Vinadu etc. Viswa&rsquo;s songs added a great flavour to the film&rsquo;s music and well received.</p>\r\n<p>Viswa turned into a composer and Music Director through the film Hyderabad Nawabs. Soon he proved his proficiency through films like Police Police, Mangala and Nenu Naa Rakshasi. The song Padithinammo which was composed, written and sung by Viswa became a catchy number in the youth.</p>\r\n<p>The title song of Dookudu, Nee dookudu, which was penned by Viswa has won the Big FM best lyrics award for the year 2011. In the same year Chiguru Boniya from the movie Teen maar, which was sung and written by Viswa also became a chartbuster hit.</p>\r\n<p>As a dubbing artist Viswa has lent his voice to many star warts like Jackie Shroff in Shakti, Kaatraj in Chatrapathi, Prabhu in Bejawada, Abhimanyu Singh in Rakhta Charithra, Rahul Dev in Simhadri, Pasupathi in Nenunnanu, Opening Voice over in Damarukam and many more. His baritone voice has elevated the characters of villains in many films.</p>\r\n<p>Now he is the music director of \" Temper\" the film of Junior NTR\'s upcoming film which is the 150th film in his career.</p>\r\n<p>Viswa the multi-faceted artiste is a blend of lyrical, vocal and musical skills with an added flavour of his creative abilities. He is usually called &ldquo;Master of all trades&rdquo;. He is not a regular &ldquo;run-of-the-mill&rdquo; artiste but surely is an entertaining one.</p>\r\n<p>The tale started when he was 6 yrs old. One day he was singing in a Durga pandal he was heard by thespian maestro Nemalikanti Radha Krishna Murthy and was picked for a play called &ldquo;Mugimpu leni Katha- written by Rallapalli (a veteran actor/author). Viswa won his first award at the age of 6, from Andhra Naataka Parishad (which was one of the most prestigious awards by the AP state Govt.before Nandi Award was introduced) as &ldquo;The Best Child Actor&rdquo;. As he grew up he emerged as a theatre artist and performed many plays at different places till the age of 14. Theatre has created immense interest and love in him for literature and music. Music and Literature took front seat in his career interests and priorities.</p>\r\n<p>Viswa had his academic stint at Andhra University where he studied Mechanical engineering degree. Soon after the completion of his degree he set out on a journey to explore his musical skills. Through a friend and musician Siva Ram he met Mani Sharma. Mani Sharma gave Viswa tremendous encouragement and a pathway into Telugu films. He was the first one to identify Viswa&rsquo;s innate lyrical, singing and musical abilities. He offered Viswa the first opportunity in one of his films named &ldquo;Priyadarshini to write as well as sing a solo song. Later, Viswa released his first music album &ldquo;Masti&rdquo; which was written, sung and composed by Viswa.</p>\r\n<p><br />R P Patnaik then offered a song in his film &ldquo;Santosham&rdquo; which was a Nagarjuna, Prabhu Deva starrer. Viswa wrote and sang a dance number &ldquo;Mehbooba Mehabooba&rdquo; which has earned him his first recognition and hit. Offers started coming in and Viswa got recognised as a lyricist who can write catchy expressions and euphemisms. He wrote for films like Adrushtam, Sivamani, Satyam and many more after that.</p>\r\n<p>A few movies later, Veteran writer and director Trivikram Srinivas who is a good friend and also studied with him in the same University offered him the title song in his upcoming film Athadu, which was written and sung by Viswa. The song went on to become an overwhelming hit and not only that it also became the biggest milestone in Viswa&rsquo;s career. The song&rsquo;s success was followed by the opportunities for title songs for films like Munna, Aarya, Asthram, Dookudu, Nippu, Teen Maar, and became huge hits. Chamka Chamka became a big hit for Ram Charan Tej. Viswa&rsquo;s songs became distinctive in every album. His style of writing and singing is unique in its own way.</p>\r\n<p>Dhaga Dhaga merise from the movie Lakshmi, You rock my world from Arya, Narthanatara from Ek Niranjan, Dole Dole from Pokiri, Disturb Cheyyaku fro athidhi, Gicchi Gicchi and Chandra Mukhi from Super, Ye oore from Badra, Va Va Varevaa from Bunny, Chal Chal re from Happy, Gundelni Pindedhi from Devdas, Yadalo Evo and Rock and Roll from Style are some of his prestigious hits which catapulted him into the league of star writers and singers. Dole Dole from Pokiri got acclaimed for its aesthetic appeal and captivating lyrics. Even in fims like Takita Takita, Mangala, Manasu Maata Vinadu etc. Viswa&rsquo;s songs added a great flavour to the film&rsquo;s music and well received.</p>\r\n<p>Viswa turned into a composer and Music Director through the film Hyderabad Nawabs. Soon he proved his proficiency through films like Police Police, Mangala and Nenu Naa Rakshasi. The song Padithinammo which was composed, written and sung by Viswa became a catchy number in the youth.</p>\r\n<p>The title song of Dookudu, Nee dookudu, which was penned by Viswa has won the Big FM best lyrics award for the year 2011. In the same year Chiguru Boniya from the movie Teen maar, which was sung and written by Viswa also became a chartbuster hit.</p>\r\n<p>As a dubbing artist Viswa has lent his voice to many star warts like Jackie Shroff in Shakti, Kaatraj in Chatrapathi, Prabhu in Bejawada, Abhimanyu Singh in Rakhta Charithra, Rahul Dev in Simhadri, Pasupathi in Nenunnanu, Opening Voice over in Damarukam and many more. His baritone voice has elevated the characters of villains in many films.</p>\r\n<p>With regards,</p>\r\n<p>Uma Ganesh</p>\r\n<p>Xth-1988</p>','2014-12-16 09:54:56','2020-05-12 01:30:31',0,8,0,1887,69,1,0,NULL,NULL,NULL,NULL),(16253,1,NULL,NULL,'2014-12-16 18:07:24','2014-12-16 18:07:24',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16254,1,'GOLDEN JUBILEE ALUMNI CELEBRATIONS-2014- UPDATES','<p>Dear Folks,</p>\r\n<p>Hundreds of Alumni folks are working to make this event a grand success.</p>\r\n<p>Our Objective:</p>\r\n<ul>\r\n<li><strong>LBR &nbsp;</strong></li>\r\n<li><strong>Meeting the Teachers and facilitate them.&nbsp; </strong></li>\r\n<li><strong>Meeting our old and new Friends &nbsp;</strong></li>\r\n<li><strong>Enjoy, have an eventful day and cherish the moment.</strong></li>\r\n</ul>\r\n<p>More than 2000 members are expected and we have planned arrangements in a grand scale, execution is in progress.</p>\r\n<ul>\r\n<li>Seating arrangements in grand scale has been planned, execution is in progress</li>\r\n<li>LBR Process worked out arrangements are in place. Let&rsquo;s break the record.</li>\r\n<li>Food Arrangements have been freezed. &nbsp;</li>\r\n<li>&nbsp;&ldquo;<a href=\"https://www.google.co.in/url?sa=t&amp;rct=j&amp;q=&amp;esrc=s&amp;source=web&amp;cd=1&amp;sqi=2&amp;ved=0CBwQFjAA&amp;url=http%3A%2F%2Fshradhanjali.com%2F&amp;ei=_YKQVKGuD9C9uASCrYDQBg&amp;usg=AFQjCNE_5Ob8t3qvfufc1qhilWgr1XAzBA&amp;bvm=bv.81828268,d.c2E\">Shradhanjali</a>&rdquo; a dedicated area in memory of our friends who have passed away has been arranged. Light a candle or give them a floral tribute.</li>\r\n<li>Cultural Programs are being practiced and we should do a good job on the event day.</li>\r\n</ul>\r\n<p>Music and Dance events: Major attractions: Singing event by Vishwa, DJ by Rahul and some highly talented members will dance, sing and entertain you.</p>\r\n<ul>\r\n<li>Teachers Facilitation.</li>\r\n<li>Parking (around the school, Hospital, Post office and Bank) areas have been identified, please use these areas. Volunteers would help members in these areas, we shall also ply some cars for the members to reach the event areas.</li>\r\n<li>Security arrangements have been planned and will be in place</li>\r\n<li>Transportation has been arranged for the Teachers, Bus/cars to ply from Secunderabad and Hyderabad areas.</li>\r\n</ul>\r\n<p>Medical Aid and Fire safety arrangements are in place.</p>','2014-12-17 01:27:03','2020-05-17 08:26:01',0,5,1,1301,NULL,1,1,NULL,NULL,NULL,NULL),(16255,1,'Important DOS ON THE DAY OF THE EVENT','<p align=\"center\">&nbsp;</p>\r\n<p>Dear Folks,</p>\r\n<ol>\r\n<li><strong>Come on Time</strong>- we are there to receive you from 8:00 AM onwards (Breakfast? Ok we&rsquo;ll take care)</li>\r\n<li>Bring your copy of <strong>Photo ID, Bona fide Certificate and Photograph</strong>- Very important for the LBR.</li>\r\n<li>Register yourself (you need to pay boss J)</li>\r\n<li>Once you step in and Register yourself, <strong>Grab the LBR personal detail Form and fill it</strong>- very important.</li>\r\n<li>You will be given a <strong>Chest Number</strong>, Take and pin it.</li>\r\n<li>Next, smile and join for the <strong>photo session</strong> with your best smile(must, ok)</li>\r\n<li>Once photographed, proceed to the event area, you are required to enjoy, so have some fun, ok.</li>\r\n</ol>\r\n<p>Please don&rsquo;t bring bombs, guns etc etc, just kidding J</p>','2014-12-17 01:30:41','2020-05-18 20:28:47',0,5,1,1221,NULL,1,1,NULL,NULL,NULL,NULL),(16256,1,'APPEAL','<p><strong>Dear Folks,</strong></p>\r\n<p><strong>We just have four more days to go for the big event on 21<sup>st</sup> the Sunday and we are sure most of us are eagerly waiting for the occasion to meet our Teachers and our old Friends and enjoy the day.</strong></p>\r\n<p><strong>Many of us have registered for the event already and many of us are thinking to get registered on the day of the event, Friends, This will make it difficult for all of us. A big challenge for us currently is the headcount estimate which is very crucial for all logistics reasons. Hence we request you all to come forward and register yourself in advance. &nbsp;Just walk into our school today or tomorrow and Register.</strong></p>\r\n<p><strong>The other important aspect apart from Logistics is our LBR Initiative which we are sure going to break it, Guys, Just imagine you being a part of an Indian Record, isn&rsquo;t that feeling great enough, I am sure our kids would be proud of us.</strong></p>\r\n<p><strong>For this to happen you have to come in large numbers and break the record, our record should stand for a very long time, right?</strong></p>\r\n<p><strong>Other request is to come on time, start coming by 8:00 AM IST (is that early? answer is NO J), Coming early is important as you are required to follow an LBR process of registration and Photo session. The early the better, so that we can move on with our big celebrations on time.</strong></p>\r\n<p><strong>The Celebrations starts with Flag Hoisting, March past (remember our &ldquo;Houses&rdquo;), Cultural and Fun Programs, a Singing show by the famous Telugu Cinema playback Singer &ldquo;Vishwa&rdquo;, our own Alumni.</strong></p>\r\n<p><strong>We have some sports events as well, and we have arranged Lunch for you guys (J we know you might be hungry with all the fun and emotions)</strong></p>\r\n<p><strong>Therefore Folks, It&rsquo;s our Golden Jubilee Celebrations lets attend in large numbers and make it a moment to cherish.</strong></p>\r\n<p><strong>Regards</strong></p>\r\n<p><strong>BHEL HSS AA</strong></p>','2014-12-17 01:35:51','2020-05-16 15:10:23',0,5,0,1532,NULL,1,1,NULL,NULL,NULL,NULL),(16257,1,NULL,NULL,'2014-12-17 07:08:19','2014-12-17 07:08:19',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16258,1,NULL,NULL,'2014-12-17 07:19:51','2014-12-17 07:19:51',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16259,1,NULL,NULL,'2014-12-17 09:35:31','2014-12-17 09:35:31',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16260,1,NULL,NULL,'2014-12-17 13:07:44','2014-12-17 13:07:44',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16261,1,NULL,NULL,'2014-12-17 14:50:44','2014-12-17 14:50:44',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16262,1,NULL,NULL,'2014-12-17 16:43:00','2014-12-17 16:43:00',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16263,1,NULL,N