experience, maybe even more than the usual, In order to frame this well, the organizing committee is composing a very interesting and lively program with distinguished alumni but also a number of cultural events. On the networking sites-facebook-bhelhssaa and bhelhss groups and our own school site-&nbsp;<a href=\"http://l.facebook.com/l.php?u=http%3A%2F%2Fbhelhss.com%2F&amp;h=aAQHWRHat&amp;enc=AZMUzyya5LXDj1mPM6vL7dp6ymK7qqSZ81q13vveaRY6TxNKZ463U4IYOA9ZfRXh1j6oilBJhHJD6-fqKcdZgacwUUWW9L5nmAM-McC02VLK_GrcTHhOItMrNgvwdwReqUinoBbMIQ8-FwiOKYhr2RPnUr5LP0yLn_kxjlG587N--Q&amp;s=1\" rel=\"nofollow\" target=\"_blank\">bhelhss.com</a>, you will find a detailed overview of this very program.</p>\r\n<p>This year we are experimenting with some new ideas We will keep all of the alumni informed regarding this . . . .For this a simple exercise should be performed by the alumni . Please update your contact data in the website<a href=\"http://l.facebook.com/l.php?u=http%3A%2F%2Fbhelhss.com%2F&amp;h=OAQFSAQoO&amp;enc=AZPQ1pw7ssouw-wtBB9i2Gf0tLoTwVYeDUPRSxK7RmSsUUigXfJpz52wcgbs-m_t7wi81BxsNroQF_t6wyAtRoJAnRMAmTSF9E1hexmE-G34O2EkdTl4cKBFT84YN_egyF6YNud5xwUvSA2GCy_D3Hi9VuwLDqHgf00H4TUQ_K7gPQ&amp;s=1\" rel=\"nofollow\" target=\"_blank\">bhelhss.com.</a></p>\r\n<p>Looking forward to welcome you to B.H.E.L. Higher Secondary School,Ramachandrapuram,Hyderabad.!</p>\r\n<p>Folks we are ready to get set go in two day for the on coming Golden Jubilee event breaking the Limca Book of Records........................................</p>','2014-12-19 10:21:26','2020-05-16 11:11:21',0,5,1,1725,NULL,1,1,NULL,NULL,NULL,NULL),(16273,1,NULL,NULL,'2014-12-19 23:18:49','2014-12-19 23:18:49',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16274,1,NULL,NULL,'2014-12-20 00:31:28','2014-12-20 00:31:28',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16275,1,NULL,NULL,'2014-12-20 00:46:10','2014-12-20 00:46:10',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16276,1,NULL,NULL,'2014-12-20 06:26:31','2014-12-20 06:26:31',0,NULL,0,1