tyle=\"border-bottom: 1px dotted #fff; font-weight: bold;\">bhelhssaa@gmail.com</span></p>','2015-01-13 16:20:13','2020-05-16 23:12:27',0,10,0,15306,NULL,1,1,NULL,NULL,NULL,NULL),(16371,1,NULL,NULL,'2015-01-14 07:55:12','2015-01-14 07:55:12',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16372,1,NULL,NULL,'2015-01-14 16:58:42','2015-01-14 16:58:42',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16373,1,'A Big Thank you','<p class=\"Publishwithline\"><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">Dear Friends,</span></p>\r\n<p><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">The Golden Jubilee Celebrations-2014 was conducted by our school Alumni Association - BHEL Higher Secondary School Alumni Association on 21<sup>st</sup> December 2014.&nbsp; We would like to take this opportunity to thank each and every one who participated in making the event a GRAND SUCCESS.&nbsp; We would like to firstly thank all the Alumni Member (close to 1000 Members) for participating and making the event a memorable one.&nbsp; We would like to thank all the Teachers &amp; Staff (80 Staff) some of them, who in spite of their ailments took time to meet us and make the day an eventful one.&nbsp;</span></p>\r\n<p><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">This has indeed been a great achievement for any school which was closed more than a decade ago to amass together and reminisce the best days of our life.</span></p>\r\n<p><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">This was our second Alumni Meet event after a gap of two years, the first meet was held in 2012 on 23<sup>rd</sup> December.&nbsp; The Second Alumni Meet now which was held on 21<sup>st</sup> December 2014 was to commemorate the 50 years of our School Inception &ndash; The GOLDEN JUBILEE Celebrations.&nbsp;&nbsp; The foundation stone for our school building was laid 50 years ago on 14<sup>th</sup> November 1964.&nbsp; Though, the school started its operations in the year 1963 from HRD Center, BHEL Ramachandrapuram.</span></p>\r\n<p><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">The atmosphere on 21<sup>st</sup> December 2014 was fully charged with emotions. It made all of us very glad, as we were able to bring together the Alumni from all batches (1969 &ndash; 2002) and the teachers.&nbsp; We are indeed blessed to have met, our Teachers who have enlightened our paths, our classmates and friends (Seniors &amp; Juniors) with whom we have spent the best part of our lives.&nbsp; It was really a cherished moment to relive and rekindle the child in each of us.&nbsp; It was day wherein we could meet some of our friends after many years.&nbsp; It was a day to reminisce those memorable moments spent in this very school campus. &nbsp;It was also a day wherein we paid respect to some of our dear ones who are no more with us.&nbsp;</span></p>\r\n<p><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">The meet was nostalgic with everyone coming out with their experience and sharing the fond memories of our school days. &nbsp;We all are very proud to have meet many of our school Alumni who have excelled in their respective areas and have tasted success in the fields be it Academics, Business, Defense, Sports, Arts, Information Technology etc.</span></p>\r\n<p><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">The success of the event was possible only because of your overwhelming participation and during this proud moment we from the Alumni Association Core Committee and the Area Coordinators want to specially thank some of the key members who have toiled months together to make the event happen in a grand scale and successfully.</span></p>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\"><span style=\"text-decoration: underline;\">BHEL Management:</span> We would like to take this opportunity to thank the BHEL Management in permitting us to conduct the event in our school premises. They also helped us in providing a room at the school premises, which helped us to executing the event activities and registrations.</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">We would like to thank Executive Directors &ndash; Mr. N Ravi Chander &amp; Mr. MK Sharma, GM (HR) &ndash; Mr. KM Lakshmi Narayan, GM (M&amp;S) - Mr. R Lakshminaryana (our own school Alumni)</span></h3>\r\n<p><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">AGM (Township Admin) &ndash; Mr.Dhananjaya Rao and other staff members of the township administration.&nbsp; AGM (M&amp;S) - Mr. Ashok Bharad.</span></p>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\"><span style=\"text-decoration: underline;\">Area Coordinators:</span> We would like to thank all the Area Coordinators whose relentless efforts for last 4 to 5 months helped us to reach out to many of our Alumni members staying in different localities, areas, states, countries. It has really been a remarkable achievement for a school which closed a decade ago to amass nearly 1000 Alumni to participate.&nbsp; This event wouldn&rsquo;t have been a success without their Salient efforts. &nbsp;</span></h3>\r\n<div align=\"center\">\r\n<table style=\"width: 665px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td width=\"36\">\r\n<p align=\"center\"><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">S No</span></p>\r\n</td>\r\n<td width=\"155\">\r\n<p align=\"center\"><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">Name</span></p>\r\n</td>\r\n<td width=\"57\">\r\n<p align=\"center\"><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">Batch</span></p>\r\n</td>\r\n<td width=\"94\">\r\n<p align=\"center\"><span style=\"font