Committee:</span>&nbsp; The Event Management Committee put in lot of efforts in listing out the requirements, budgeting, evaluating various vendors, identifying the vendors, negotiating on the costs, coordinating with the Vendor and supervising the arrangements to make the event a success.</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">Our Special Thanks to PC Sreehari (1985), Abdul Quddoos (1986), Surya Rao (1983), A Sreenivasan (1986) and TK Anil for their relentless efforts. We would like to thank our Event Manager Md. Shakeeruddin (1990) and his partner Satyanarayana Burra (1983) for their contribution in making the event a success.</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\"><span style=\"text-decoration: underline;\">Cultural Committee:</span> The Cultural Committee has worked towards making the event a memorable one by chalking out the programs and co-ordinating with the participants for the Cultural Activities.&nbsp; Our special thanks to Kausalya (1990), Sampath Prathivadi (1983) and Madhuri (1975) in making the day a memorable one. The team also helped immensely in pooling up sponsors for the cultural programs.&nbsp;</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">Our special Thanks to Vishwa our school alumni who is a playback signer and music director in Tollywood to perform for the event and release an anthem for the School.&nbsp; We would also want to thank all the participants of the Cultural Programs who took out their valuable time to practice and perform.&nbsp; Our special thanks to Ms. Jayalakshmi who kept us captivating with her anchoring.</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\"><span style=\"text-decoration: underline;\">Food Committee:</span> The Food Committee team was responsible for finalizing the sumptuous food menu and was also responsible for evaluation and finalization of the vendor for cooking at an economical price. The food was very tasty and delicious and our sincere thanks to Arif (1983) and Vishal (1987) and TK Anil.&nbsp; Our Special Thanks to Subramaniam (1988) for supervising the proceedings at the Food Area and co-originating with the Food Vendor.</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\"><span style=\"text-decoration: underline;\">Invitation to Teachers and Principals:</span> &nbsp;Our special thanks to Gayathri (1985) for being the single point of contact with all the Principals, Teachers and other staff members of our school.&nbsp; She has done a commendable job in reaching out to more than 165 staff members from our school.&nbsp; She took up the responsibility to ensure that the teachers felt comfortable and attended to all their needs on the day of the event. &nbsp;&nbsp;It is worth appreciating her efforts as nobody else could have done this better than her.</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\"><span style=\"text-decoration: underline;\">Donors:</span> A Big Thank you for all Alumni members who have donated generously. Their contributions helped us to conduct the event in befitting manner. We would soon publish the list of donor&rsquo;s on the school website.</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\"><span style=\"text-decoration: underline;\">Sponsorships Committee:</span>&nbsp; We would like to thank the committee members Gorthi Srinivas (1983) Sandhya Rani Sunkara (1997) and Satyanarayana Burra (1983) who were instrumental in reaching out to the sponsor&rsquo;s and bringing in sponsorship&rsquo;s to mobilize funds for the event.&nbsp;</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">We would like to take this opportunity to thank the Sponsors:</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">The 1984 batch&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Sponsor&rsquo;s for the Mementos to the Teachers</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">The 1990 batch&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Sponsor&rsquo;s for the Shawls for Teachers and a Banner</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">Sandhya Rani Sunkara &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Sponsor for Photography and Videography</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">Md. Ishaq&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Sponsor for Snacks</span></h3>\r\n<p><strong><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">Ravikanth &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -Sponsored a Painting (proceeds of the Auction donated to Associaton)&nbsp;</span></strong></p>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">Chirra Srinivas &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - Sponsor for water bottles (200 ml)</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\"><span style=\"text-decoration: underline;\">Security Arrangements</span>:&nbsp; Our sincere thanks to Anuradha (1986), Manmohan (1983) and PC Sreehari (1985), for supervising and coordinating for the security requirements and ensuring that security was adequate and the event went on well without any issues.</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\"><span style=\"text-decoration: underline;\">Registrations Counter: &nbsp;</span>Our sincere thanks to V.Srinivasan (1985), Neelaveni (1986), Ravi Santosh Roy (XX), Ravindra Podjale (1988), PL Srinivas(1988), Swathi Guha(1988) and A Sainadhan(1979) for managing the Reception and Registration Counters</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\"><span style=\"text-decoration: underline;\">Logistics:</span> &nbsp;Our special thanks to Ashok Barad (1977) who helped us with transport facility to pick and drop our teachers.</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\"><span style=\"text-decoration: underline;\">Print and Electronic Media</span>: &nbsp;We would like to thank all the personnel from various Print and Media houses for covering our school event in their respective Newspapers/Websites/TV Channels.</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">Our special thanks to Ravindranath (1988) and Managing Director - TV5 for providing the scrolling of the Event and helping us reach out to many of our school Alumni from distant places.&nbsp; Our special thanks to the TV5 crew who captured the complete event and telecast on their channel.</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">Our Special thanks to Mr. Satyanarayana Burra (1983), Sashibushan (1969), Mr. Sampath Prathivadi (1983) and Gorthi Sreenivas (1983), and Mr. Stalin Niri (1997) for coordinating with various Print and Electronic Media and ensuring they publish the event in their respective media.</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\"><span style=\"text-decoration: underline;\">Publicity</span>: Our Special Thanks to Abdul Quddoos (1986) for his contribution in managing the publicity material. &nbsp;&nbsp;We would also like to thank Uma Ganesh (1988) for coordinating with the Alumni to address their queries.</span></h3>\r\n<p>&nbsp;</p>\r\n<p><strong><span style=\"text-decoration: underline;\"><span>Medical Aid:</span></span></strong><span class=\"apple-converted-space\"><strong><span>&nbsp;</span></strong></span><strong><span>Citizens Hospital sponsored a Medical Aid Center, A team of 8 Medicos with complete support system was setup at the event. Indresh(1994) initiated and coordinated the effort.</span></strong></p>\r\n<p><span style=\"text-decoration: underline;\">Website</span><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">: A special thanks to Preetam Pawar (1999), the web developer, and Anil Thekkut (1986) for managing and posting the updates on our Website.</span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif; font-size: small;\">Last but not the least we would like to thank all the Core Team members for their Valuable contribution in coordinating with all the team members and making the event a Grand Success.&nbsp; We would like to thank all the Alumni once again for contributing to the Success of the Event.&nbsp; We request you to kindly pardon us if we have missed out any name,&nbsp;&nbsp; this is not intentional and request you to forgive us.</span></p>\r\n<h3><span style=\"font-size: small; font-family: arial, helvetica, sans-serif;\">Thanks and Regards</span></h3>\r\n<h3><span style=\"font-size: small; font-family: arial,