ULL,NULL,'2015-08-09 22:55:08','2015-08-09 22:55:08',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16902,1,'I N D E P E N D E N C E --- D A Y  BHEL HIGHER SECONDARY SCHOOL,BHEL','<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong><span>Folks,</span></strong></p>\r\n<p><strong><span>We are getting together on 15<sup>th</sup>&nbsp;August, at 09:00 Hrs to celebrate the spirit of Independence Day at our School.</span></strong></p>\r\n<p><strong><span>The day would commence with hoisting the National Flag and Singing the National Song in the presence of the Drumbeat to make us remember our school days,</span></strong></p>\r\n<p><strong><span>There would be some activities for all of us and also games in the campus.&nbsp;</span></strong></p>\r\n<p><strong><span>Would like to meet all the classmates and school mates and make the function and the day a grand success......</span></strong></p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p><strong><span>See you then,</span></strong></p>\r\n<p><strong><span>&nbsp;</span></strong></p>\r\n<p><strong><span>Regards</span></strong></p>\r\n<p><strong><span>BHEL HSS Alumni Association</span></strong></p>','2015-08-12 12:38:06','2020-05-12 05:50:38',0,8,0,937,69,1,0,NULL,NULL,NULL,NULL),(16903,1,NULL,NULL,'2015-08-13 22:02:27','2015-08-13 22:02:27',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16904,1,NULL,NULL,'2015-08-17 12:12:59','2015-08-17 12:12:59',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16905,1,'Independence Day Celebrations-2015','<p>Folks,</p>\r\n<p>We celebrated Independence Day at our School. The National Flag was hoisted by our Teacher, Mr Jaganmohan Sir.</p>\r\n<p>A status update of our Associations financial Accounts and our achievements for the period 2012-2014 was announced.</p>\r\n<p>Mementos were given to Volunteers of our association who worked very hard to meet and pool up Alumni members. We have over 350 life members and over 1100 Alumni attended the Reunion meet of December-2014.</p>\r\n<p>&nbsp;</p>\r\n<p>Thank you</p>\r\n<p>Regards</p>\r\n<p>BHEL HSS Alumni Association.</p>','2015-08-17 22:26:14','2020-05-16 12:00:35',0,5,1,1975,NULL,1,1,NULL,NULL,NULL,NULL),(16906,1,'Donations to Old Age Home','<p>Folks,</p>\r\n<p>On behalf of all Alumni Members, BHEL HSS Alumni Association has donated 54 Shawls to needy aged people staying at Shiridi Sai Old Age Home, Miyapur, Hyderabad.</p>\r\n<p>Thanks to all members.</p>\r\n<p>&nbsp;</p>\r\n<p>Regards</p>\r\n<p>BHEL HSS Alumni Association.&nbsp;</p>','2015-08-17 22:44:30','2020-05-17 05:42:12',0,12,1,1127,NULL,1,1,NULL,NULL,NULL,NULL),(16907,1,'Need software engineer with 3-5 years of experience on JavaJ2EE ','<p><strong><span style=\"font-size: medium;\">Valuelabs is hiring...</span></strong></p>\r\n<p>Position: Software Engineer/Senior Software Engineer<br />Experience: 3-5 Yrs.<br />Education Qualification: Bachelor\'s degree from a recognised university<br /><br />Requirement:<br />Strong experience in Java/J2EE<br />Experience on Spring &amp; Hibernate frameworks<br />Good to have Web services experience<br />Must be available to join in 15 days<br /><br />Last date to send your resumes: 1st September 2015<br /><br />Send your resumes to <span style=\"text-decoration: underline; font-size: medium;\"><strong>preetham.pawar@valuelabs.net</strong></span><br /><br /></p>','2015-08-18 10:22:24','2020-05-18 11:47:27',0,11,0,932,NULL,1,1,NULL,NULL,NULL,NULL),(16908,1,NULL,NULL,'2015-08-18 14:44:27','2015-08-18 14:44:27',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16909,1,NULL,NULL,'2015-08-21 04:59:02','2015-08-21 04:59:02',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16910,1,NULL,NULL,'2015-08-21 16:50:35','2015-08-21 16:50:35',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16911,1,NULL,NULL,'2015-08-23 04:18:32','2015-08-23 04:18:32',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16912,1,NULL,NULL,'2015-08-25 09:26:04','2015-08-25 09:26:04',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(16913,1,NULL,NULL,'2015-08-26 05:12:02','2015-08-26 05:12:02',0,NULL,0,1,NULL,1,1,NULL