e for Osmansagar and Himayathsagar. It is considered as one of the dense forests in Telangana region. Ananthagiri has a famous temple located in this forested region, which is also the birthplace of Musi River. It is situated at a distance of about 90 km from Hyderabad City and a popular destination for trekking and for those who love adventure. It is also considered one of the earliest human habitat areas in South India. Ancient caves, medieval fort like structures and ancient temple shows the history of the area.</p>\r\n<p>It is a much sought after place, which is covered, by red soil and ideal for some adventure sports. Visitors rate it as one of most beautiful places for a weekend get away from Hyderabad. The road is in good condition, which takes you into the dense forests with beautiful trees and streams all along the way. Near the lighthouse if you take a 2 km diversion, you can reach the topmost point in the Vikarabad region, which offers an excellent view point. A trip to Vikarabad on a cloudy day with a little drizzle is simply an unforgettable experience and it is a poor man&rsquo;s Ooty in summer.</p>\r\n<p>For accommodation in Ananthagiri hills you can choose Hairtha Resort at Ananthagiri Hills which has a tariff of INR1500 per day and the second option is Deccan Trails. Haritha valley resort operates a restaurant serving both vegetarian and non-vegetarian cuisines. The small reservoir, the lush green jungle, the jungle trail are all an added attraction to this place covered by thick vegetation, small rivulets and beautiful streams with fresh water.</p>\r\n<h1 id=\"content\" class=\"destination--header\">How to Reach</h1>\r\n<p>Ananthagiri hills is easily accessible road, located nearly 90 km away from Hyderabad.</p>\r\n<h1 id=\"content\" class=\"destination--header\"><span class=\"icon-glyph iconBorder\" data-icon=\"%\"><img src=\"http://www.telanganatourism.gov.in/images/icons/eat_icon.png\" alt=\"\" /></span>Where to eat</h1>\r\n<p>Haritha Valley View Resort, Ananthagiri offers quality fare for tourists.</p>\r\n<h1 id=\"content\" class=\"destination--header\">Where to stay</h1>\r\n<p>Haritha Valley View Resort, Ananthagiri boasts of modern A/C suites and rooms, offering comfortable accommodation while the campfire organized at Ananthagiri resort offers a wonderful experience.</p>\r\n<p>&nbsp;</p>\r\n<p>Hope we shall all go with our childhood friends and have a picnic with our childhood friends on 8th November,2015 Sunday.More good experience would &nbsp;be by going on our own vehicles. Please show your consent by calling/ messaging to Mrs.Uma Ganesh &nbsp;to 9676803291 before end of day today.</p>\r\n<p>&nbsp;</p>\r\n<p>Wishing most of you all join the trip.</p>\r\n<p>&nbsp;</p>\r\n<p>Thanks and regards,</p>\r\n<p>Mrs.Uma Ganesh</p>','2015-11-06 10:44:05','2020-05-11 01:15:14',0,8,0,1590,69,1,1,NULL,NULL,NULL,NULL),(17008,1,NULL,NULL,'2015-11-10 13:22:15','2015-11-10 13:22:15',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17009,1,NULL,NULL,'2015-11-12 11:59:12','2015-11-12 11:59:12',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17010,1,NULL,NULL,'2015-11-12 16:23:49','2015-11-12 16:23:49',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17011,1,NULL,NULL,'2015-11-12 16:23:51','2015-11-12 16:23:51',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17012,1,NULL,NULL,'2015-11-19 22:48:14','2015-11-19 22:48:14',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17013,1,NULL,NULL,'2015-11-21 02:25:04','2015-11-21 02:25:04',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17014,1,NULL,NULL,'2015-11-21 14:41:29','2015-11-21 14:41:29',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17015,1,NULL,NULL,'2015-11-23 11:48:49','2015-11-23 11:48:49',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17016,1,NULL,NULL,'2015-11-23 20:11:31','2015-11-23 20:11:31',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17017,1,NULL,NULL,'2015-11-26 08:38:31','2015-11-26 08:38:31',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17018,1,NULL,NULL,'2015-11-26 12:25:05','2015-11-26 12:25:05',0,NULL,0,1,NUL