nd make this event a success. You are requested to bring in your family, children and friends as well.</strong></p>\r\n<p><strong>Date: 19th February 2017 </strong></p>\r\n<p><strong>Venue: Our School</strong></p>\r\n<p><strong>Time: 10:00 AM to 12:00 PM</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Program:</p>\r\n<ol>\r\n<li>\r\n<p><span style=\"text-decoration: underline;\">Discussion on Health and Wellness</span></p>\r\n</li>\r\n</ol>\r\n<p><span style=\"color: #000000; font-family: Calibri; font-size: medium;\">Simple Answers to Critical Diseases by Mr. UV Ramana Sir.</span></p>\r\n<ol>\r\n<li>\r\n<p><span style=\"text-decoration: underline;\">Education</span></p>\r\n</li>\r\n</ol>\r\n<p><span style=\"color: #000000; font-family: Calibri; font-size: medium;\">Career and Further Education options for 10+2 and Degree Students by Mr. SAMV Prasad Rao</span></p>\r\n<ol>\r\n<li>\r\n<p><span style=\"text-decoration: underline;\">Finance </span></p>\r\n</li>\r\n</ol>\r\n<p><span style=\"color: #000000; font-family: Calibri; font-size: medium;\">Financial planning- A suggestion session by Mr. Jacob S</span></p>\r\n<ol>\r\n<li>\r\n<p><span style=\"text-decoration: underline;\">Other Discussion Points</span></p>\r\n</li>\r\n</ol>\r\n<p><span style=\"color: #000000; font-family: Calibri; font-size: medium;\">Career Opportunities for others</span></p>\r\n<p><span style=\"color: #000000; font-family: Calibri; font-size: medium;\">Networking</span></p>\r\n<p><span style=\"color: #000000; font-family: Calibri; font-size: medium;\">Feedback</span></p>\r\n<p><span style=\"color: #000000; font-family: Calibri; font-size: medium;\">&nbsp;</span></p>\r\n<p><span style=\"color: #000000; font-family: Calibri; font-size: medium;\">Please reach out to Anil Thekkut @9949982399 for any information/clarifications</span></p>\r\n<p><span style=\"color: #000000; font-family: Calibri; font-size: medium;\">Thank you</span></p>\r\n<p><span style=\"color: #000000; font-family: Calibri; font-size: medium;\