splays the defense and military capability, cultural heritage and research innovation of India. The celebration of Republic Day continues for three days and ends on 29<span>th</span>&nbsp;January.</p>\r\n<p>We also celebrate with the same gaity. We are going to have our Sanskrit cum Telugu sir Mr.Anangachary&nbsp; to hoist the flag at our school campus at 9am sharp. Please do join and make it a grand success.</p>\r\n<p>Regards,</p>\r\n<p>BHELHSSAA</p>','2018-01-25 11:40:48','2020-05-15 02:03:51',0,5,1,890,NULL,1,1,NULL,NULL,NULL,NULL),(17389,1,NULL,NULL,'2018-01-26 23:55:29','2018-01-26 23:55:29',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17390,1,NULL,NULL,'2018-01-31 20:57:46','2018-01-31 20:57:46',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17391,1,NULL,NULL,'2018-02-04 16:47:12','2018-02-04 16:47:12',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17392,1,NULL,NULL,'2018-02-08 08:36:58','2018-02-08 08:36:58',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17393,1,NULL,NULL,'2018-02-12 20:08:19','2018-02-12 20:08:19',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17394,1,NULL,NULL,'2018-02-18 00:30:08','2018-02-18 00:30:08',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17395,1,NULL,NULL,'2018-02-18 16:51:54','2018-02-18 16:51:54',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17396,1,NULL,NULL,'2018-02-20 18:40:27','2018-02-20 18:40:27',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17397,1,NULL,NULL,'2018-02-24 05:21:09','2018-02-24 05:21:09',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17398,1,NULL,NULL,'2018-02-27 08:58:54','2018-02-27 08:58:54',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17399,1,NULL,NULL,'2018-02-28 18:10:27','2018-02-28 18:10:27',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17400,1,NULL,NULL,'2018-03-03 08:35:53','2018-03-03 08:35:53',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17401,1,NULL,NULL,'2018-03-05 14:48:29','2018-03-05 14:48:29',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17402,1,NULL,NULL,'2018-03-07 18:54:44','2018-03-07 18:54:44',0,NULL,0,1,NULL,1,1,NULL,NULL,NULL,NULL),(17